fragment:
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:conventional_lipoma rdfs:subClassOf :lipoma ;
    :has_definition "A lipoma that is characterized as a benign well-circumscribed tumor, composed of lobules of mature adipocytes, that arises within subcutaneous tissue, deep soft tissues or on the surface of bones." ;
    :has_exact_synonym "classic type lipoma" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:kidney_lipoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :adipocyte ],
        :kidney_benign_neoplasm,
        :lipoma ;
    :has_definition "A lipoma that is located in the kidney." ;
    :has_exact_synonym "Lipoma of kidney"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pleural_lipoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :pleura ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :adipocyte ],
        :lipoma,
        :pleural_disease,
        :respiratory_system_benign_neoplasm ;
    :has_definition "A respiratory system benign neoplasm that derives_from fat cells and is located_in the pleura." ;
    :has_exact_synonym "Lipoma of Pleura"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:breast_lipoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :adipocyte ],
        :breast_benign_neoplasm,
        :lipoma ;
    :has_definition "A breast benign neoplasm that is composed of lipocytes." ;
    :has_exact_synonym "Lipoma of breast"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chest_wall_lipoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :adipocyte ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :chest_wall ],
        :lipoma,
        :thoracic_benign_neoplasm ;
    :has_definition "A thoracic benign neoplasm that derives_from fat cells and is located_in the chest wall." ;
    :has_exact_synonym "Lipoma of the Chest Wall"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gallbladder_lipoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :adipocyte ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :gallbladder ],
        :gallbladder_benign_neoplasm,
        :lipoma ;
    :has_definition "A gallbladder benign neoplasm that is located_in the gallbladder and derives_from fat cells." ;
    :has_exact_synonym "Lipoma of the gallbladder"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:external_ear_lipoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :external_acoustic_meatus ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :adipocyte ],
        :auditory_system_benign_neoplasm,
        :lipoma ;
    :has_definition "An auditory system benign neoplasm that is located in the external ear." ;
    :has_exact_synonym "external auditory meatus lipoma",
        "Lipoma of external auditory meatus"@en,
        "Lipoma of the External ear"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:axillary_lipoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :adipocyte ],
        :lipoma,
        :thoracic_benign_neoplasm ;
    :has_definition "An thoracic benign neoplasm that is located_in the axilla, an area directly under the arm and shoulder joint composed_of adipose tissue." ;
    :has_exact_synonym "Lipoma of axilla"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lipoma_of_spermatic_cord rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :spermatic_cord ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :adipocyte ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :male_reproductive_system ],
        :male_reproductive_organ_benign_neoplasm,
        :paratesticular_lipoma ;
    :has_definition "A paratesticular lipoma that is located_in the spermatic cord and derives_from fat cells." ;
    :has_exact_synonym "Spermatic Cord Lipoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:paratesticular_lipoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :adipocyte ],
        :lipoma,
        :reproductive_organ_benign_neoplasm ;
    :has_definition "A reproductive organ benign neoplasm that derives_from fat cells located_in the paratesticular region." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chondroid_lipoma rdfs:subClassOf :lipoma ;
    :has_definition "A lipoma that is a deep-seated, firm, yellow tumors that characteristically occur on the legs of women." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:extrahepatic_bile_duct_lipoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :extrahepatic_bile_duct ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :adipocyte ],
        :bile_duct_disease,
        :biliary_tract_benign_neoplasm,
        :lipoma ;
    :has_definition "A biliary tract benign neoplasm that is located_in the extrahepatic bile duct and derives_from fat cells." ;
    :has_exact_synonym "Lipoma of the extrahepatic bile duct"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pinta_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :contact_transmission ],
        :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that results_in infection located_in skin, has_material_basis_in Treponema carateum, which is transmitted_by contact with skin and mucous membrane of an infected person. The infection has_symptom pruritic plaque, which slowly enlarges and becomes pigmented and hyperkeratotic." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dermatomyositis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        :myositis,
        :skin_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :myositis ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :zone_of_skin ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :disease_has_location ;
                                            owl:someValuesFrom :muscle_tissue ] ;
                                    rdf:rest :nil ] ] ] ] ;
    :has_definition "A myositis that results_in inflammation located_in muscle or located_in skin where a skin rash is often seen prior to the onset of muscle weakness. The disease may result from either a viral infection or an autoimmune reaction." ;
    :has_exact_synonym "Polymyositis with skin involvement"@en,
        "dermatopolymyositis"@en ;
    :has_related_synonym "Amyopathic dermatomyositis",
        "Amyopathic dermatomyositis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:borderline_leprosy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :droplet_spread_transmission ],
        :leprosy ;
    :has_definition "A leprosy that results in small numerous red irregularly shaped plaques." ;
    :has_exact_synonym "Borderline or dimorphous leprosy"@en,
        "Midborderline leprosy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aortic_atherosclerosis rdfs:subClassOf :atherosclerosis ;
    :has_exact_synonym "Atherosclerosis of aorta"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:histoplasmosis_pericarditis rdfs:subClassOf :pericarditis ;
    :has_exact_synonym "Histoplasmosis with pericarditis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brown_s_tendon_sheath_syndrome rdfs:subClassOf :mechanical_strabismus ;
    :has_definition "A mechanical strabismus that is characterized by impairment of eye movements." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:exhibitionism rdfs:subClassOf :paraphilia_disorder ;
    :has_definition "A paraphilia disorder that is characterized by recurrent sexual urges, fantasies, or behaviors involving the exposure of one's genitals to an unsuspecting stranger." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:leprosy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :mycobacterium_leprae ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :skin_lesion ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :peripheral_nervous_system ;
                            rdf:rest [ rdf:first :testis ;
                                    rdf:rest [ rdf:first :eye ;
                                            rdf:rest [ rdf:first :upper_respiratory_tract ;
                                                    rdf:rest :nil ] ] ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :droplet_spread_transmission ],
        :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that results_in infection located_in superficial peripheral nerves, located_in skin, located_in mucous membranes of the upper respiratory tract, located_in anterior chamber of the eyes, or located_in testes, has_material_basis_in Mycobacterium leprae, which is transmitted_by aerosol spread from infected nasal secretions to exposed nasal and oral mucosa. The infection has_symptom skin lesions, has_symptom sensory loss, has_symptom motor loss and has_symptom eye damage." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thalassemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :hemolytic_anemia ;
    :has_definition "A hemolytic anemia characterized by decreased synthesis of one or more hemoglobin polypeptide chains." ;
    :has_exact_synonym "Sickle-cell thalassemia with crisis"@en,
        "Sickle-cell thalassemia without crisis"@en,
        "thalassemia Hb-S disease with crisis"@en,
        "thalassemia Hb-S disease without crisis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ehrlichiosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :ehrlichia_chaffeensis ;
                            rdf:rest [ rdf:first :anaplasma_phagocytophilum ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fatigue ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :rash ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :tick_borne_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that results in infection located_in leukocyte, has_material_basis_in Ehrlichia chaffeensis or Anaplasma phagocytophilum, which are transmitted_by lone star tick and transmitted_by black-legged tick respectively. The infection has_symptom headache, has_symptom muscle aches, has_symptom fatigue and has_symptom rash." ;
    :has_exact_match "MESH:D016873" ;
    :has_exact_synonym "human ehrlichiosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pleurisy rdfs:subClassOf :pleural_disease ;
    :has_definition "A pleural disease that is characterized by inflammation of the pleura, the lining of the pleural cavity surrounding the lungs." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tuberculoid_leprosy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :droplet_spread_transmission ],
        :leprosy ;
    :has_definition "A leprosy that results in one erythematous large plaque with well-defined borders that are elevated and that slope down into an atrophic center." ;
    :has_exact_synonym "Smooth leprosy"@en,
        "type T leprosy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:louping_ill rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :louping_ill_virus ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :ixodes_ricinus ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :lethargy ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_pain ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that results in infection in sheep and rarely humans, has_material_basis_in Louping ill virus, which is transmitted by sheep tick, Ixodes ricinus. The infection has symptom lethargy, has symptom muscle pains, has symptom fever, and has symptom focal neurological signs." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:strawberry_gallbladder rdfs:subClassOf :gallbladder_disease ;
    :has_exact_synonym "Cholesterolosis of gallbladder"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:otorrhea rdfs:subClassOf :auditory_system_disease ;
    :has_definition "An auditory system disease that is characterized by the discharge or drainage of fluid from the ear." ;
    :has_exact_synonym "discharging ear" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mumps rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :mumps_orthorubulavirus ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :droplet_spread_transmission ;
                            rdf:rest [ rdf:first :vehicle_borne_fomite_transmission ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :tiredness ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :loss_of_appetite ],
        :herpangina,
        :salivary_gland_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :viral_infectious_disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :saliva_secreting_gland ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A viral infectious disease that results in inflammation located in salivary gland, has_material_basis_in Mumps rubulavirus, which is transmitted by droplet spread of saliva or mucus from the mouth, nose, or throat of an infected person, or transmitted by contaminated fomites. The infection has symptom fever, has symptom headache, has symptom muscle aches, has symptom tiredness, has symptom loss of appetite, has symptom swollen and tender salivary glands under the ears or jaw on one or both sides of the face." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:left_bundle_branch_hemiblock rdfs:subClassOf :heart_conduction_disease ;
    :has_exact_synonym "Left bundle branch block"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:heart_conduction_disease rdfs:subClassOf :heart_disease ;
    :has_definition "A cardiovascular system disease that involves the heart's electrical conduction system." ;
    :has_exact_synonym "heart rhythm disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:prostate_cancer rdfs:subClassOf :male_reproductive_organ_cancer,
        :prostate_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :prostate_gland ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A male reproductive organ cancer that is located_in the prostate." ;
    :has_exact_synonym "NGP - new growth of prostate"@en,
        "hereditary prostate cancer"@en,
        "malignant tumor of the prostate"@en,
        "prostate cancer, familial"@en,
        "prostate neoplasm"@en,
        "prostatic cancer"@en,
        "prostatic neoplasm"@en,
        "tumor of the prostate"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:prostate_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :epithelial_cell ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :prostate_gland ],
        :carcinoma,
        :prostate_cancer ;
    :has_definition "A prostate cancer that has_material_basis_in abnormally proliferating cells derives_from epithelial cells." ;
    :has_exact_synonym "cancer of prostate"@en,
        "carcinoma of prostate"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:prostate_squamous_cell_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :squamous_epithelial_cell ],
        :prostate_carcinoma,
        :squamous_cell_carcinoma ;
    :has_definition "A squamous cell carcinoma that is located_in the prostate." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:prostate_malignant_phyllodes_tumor rdfs:subClassOf :prostate_cancer ;
    :has_definition "A prostate cancer that is characterized by the presence of glandular elements and a cellular stroma that exhibits mitotic activity and nuclear atypia and that arises from the prostate gland." ;
    :has_exact_synonym "malignant Phyllodes neoplasm of the prostate"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:familial_periodic_paralysis rdfs:subClassOf :metal_metabolism_disorder ;
    :has_definition "A metal metabolism disorder that is characterized by episodes of muscle paralysis in which the affected muscles become flaccid and the deep tendon reflexes disappear. Between the episodes the affected muscles usually work normally, and that are caused by mutations in genes involved in the sodium and calcium channels in nerve cells." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:prostate_lymphoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :lymphocyte ],
        :lymphoma,
        :prostate_cancer ;
    :has_definition "A prostate cancer that affects lymphocytes and arises from the prostate gland." ;
    :has_exact_synonym "lymphoma of prostate"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:monocular_esotropia rdfs:subClassOf :esotropia ;
    :has_definition "An esotropia that is characterized by an excessive convergence of the visual axes, resulting in a cross-eye appearance." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:raynaud_disease rdfs:subClassOf :peripheral_vascular_disease ;
    :has_definition "A peripheral vascular disease that is characterized by bilateral Raynaud phenomenon, the abrupt onset of digital paleness or cyanosis in response to cold exposure or stress." ;
    :has_exact_match "MESH:D011928" ;
    :has_exact_synonym "Raynaud's disease"@en,
        "Raynaud's syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:parotitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :parotid_disease ;
    :has_definition "A parotid disease characterized by the inflammation of one or both parotid glands." ;
    :has_exact_match "MESH:D010309" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:parotid_disease rdfs:subClassOf :salivary_gland_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :parotid_gland ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A salivary gland disease that is located in the parotid gland." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sialadenitis rdfs:subClassOf :salivary_gland_disease ;
    :has_definition "A salivary gland disease that is characterized as an infection of the salivary glands." ;
    :has_exact_synonym "Sialoadenitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:viral_meningitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :viruses ],
        :meningitis,
        :viral_infectious_disease ;
    :has_definition "A meningitis that has_material_basis_in a viral infection." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:endocarditis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :endocardium_disease ;
    :has_definition "A endocardium disease characterized by inflammation of the endocardium of the heart chambers and valves." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pneumoconiosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :airborne_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormal_pulmonary_interstitial_morphology ],
        :interstitial_lung_disease ;
    :has_definition "An interstitial lung disease that is caused by the inhalation of dust." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mixed_mineral_dust_pneumoconiosis rdfs:subClassOf :pneumoconiosis ;
    :has_definition "A pneumoconiosis caused by the inhalation of mixed mineral dust particles." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:asbestosis rdfs:subClassOf :pneumoconiosis ;
    :has_definition "A pneumoconiosis caused by inhalation and retention of asbestos fibers." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:baritosis rdfs:subClassOf :pneumoconiosis ;
    :has_definition "A pneumoconiosis that is characterized by the formation of fine dense lesions in the lung parenchyma, caused by long standing exposure to barium dust. The lesions do not affect the lung function and disappear without treatment after the exposure to barium dust stops." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:berylliosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :allergic_reaction ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :respiratory_tract ],
        :pneumoconiosis,
        :respiratory_allergy ;
    :has_definition "A pneumoconiosis that involves allergic response located_in lungs caused by inhalation of beryllium compounds." ;
    :has_exact_synonym "beryllium poisoning"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:byssinosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chest_tightness ],
        :pneumoconiosis ;
    :has_definition "A pneumoconiosis that is characterized by hypersensitive reaction to inhaled dust during the initial processing of cotton, flax, or hemp, and has symptoms of chest tightness, cough and wheezing." ;
    :has_exact_synonym "Flax-dressers' disease"@en,
        "Stripper's asthma"@en,
        "cotton mill fever"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anthracosilicosis rdfs:subClassOf :pneumoconiosis ;
    :has_definition "A pneumoconiosis that is characterized by fibrosis of the lung parenchyma caused by inhalation of carbon and silica dust. It manifests as shortness of breath and induces fibrous nodule formation in the lung." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:silicosis rdfs:subClassOf :pneumoconiosis ;
    :has_definition "A pneumoconiosis that is an inflammation and scarring of the uper lobes of the lungs causing nodular lesions resulting from inhalation of silica, quartz or slate particles." ;
    :has_exact_synonym "Pneumoconiosis due to silicates"@en,
        "Silica pneumoconiosis"@en,
        "Silicotic fibrosis of lung"@en,
        "silicotuberculosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:caplan_s_syndrome rdfs:subClassOf :pneumoconiosis ;
    :has_definition "A pneumoconiosis that results_in humans that also have rheumatoid arthritis." ;
    :has_exact_synonym "Caplan syndrome"@en,
        "Caplan's disease"@en,
        "Caplans syndrome"@en,
        "Rheumatoid pneumoconiosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anthracosis rdfs:subClassOf :pneumoconiosis ;
    :has_definition "A pneumoconiosis that is characterized by deposition of carbon or coal dust in the lung parenchyma leading to the formation of black nodules and emphysema." ;
    :has_exact_synonym "Coal Miner's Pneumoconiosis"@en,
        "Coal workers' lung"@en,
        "Coal workers' pneumoconiosis"@en,
        "Melanoedema"@en,
        "black lung"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:siderosis rdfs:subClassOf :pneumoconiosis ;
    :has_definition "A pneumoconiosis that is characterized by the deposition of excess iron in body tissue resulting from inhalation of iron in the mining dust or welding fumes." ;
    :has_exact_synonym "pulmonary siderosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pulmonary_talcosis rdfs:subClassOf :pneumoconiosis ;
    :has_definition "A pneumoconiosis that is characterized by fibrosis and granulomatous changes in the lung parenchyma and resulting from exposure to talc." ;
    :has_exact_synonym "pneumoconiosis due to talc"@en,
        "talc pneumoconiosis"@en,
        "talcosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:slate_pneumoconiosis rdfs:subClassOf :pneumoconiosis ;
    :has_definition "A pneumoconiosis that is caused by exposure to slate dust." ;
    :has_exact_synonym "Schistosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:kaolin_pneumoconiosis rdfs:subClassOf :pneumoconiosis ;
    :has_definition "A pneumoconiosis that is caused by inhalation of kaolin dust." ;
    :has_exact_synonym "Kaolinosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:glaucomatous_atrophy_of_optic_disc rdfs:subClassOf :optic_atrophy ;
    :has_definition "An optic atrophy that is characterized by optic nerve damage with increased optic cup to disc ratio secondary to glaucoma, which is an eye disease related to abnormal aqueous fluid outflow that inappropriately raises intraocular pressure and results in optic nerve atrophy with progressive visual field loss. Glaucomatous atrophy of optic disc can be caused by any form of glaucoma." ;
    :has_exact_synonym "Glaucomatous atrophy [cupping] of optic disc"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:blepharophimosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :eyelid_disease,
        :physical_disorder ;
    :has_definition "An eyelid disease that is characterized by abnormal narrowness of the palpebral fissure in the horizontal direction caused by the lateral displacement of the medial canthi of the eyelids." ;
    :has_exact_match "MESH:D016569" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:solitary_cyst_of_breast rdfs:subClassOf :breast_cyst ;
    :has_definition "A breast cyst that is characterized by single, fluid-filled cyst in the breast parenchyma." ;
    :has_exact_synonym "Solitary Cyst of the breast"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aggressive_nk_cell_leukemia rdfs:subClassOf :cell_type_cancer,
        :leukemia ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :leukemia ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :derives_from ;
                                    owl:someValuesFrom :natural_killer_cell ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A leukemia that is characterized by the systemic proliferation of NK cells closely associated with Epstein-Barr virus and that is located_in the peripheral blood, bone marrow, liver, and spleen." ;
    :has_exact_synonym "aggressive NK-cell leukaemia"@en,
        "large granular Lymphocyte Leukemia, NK-cell type"@en,
        "natural killer cell leukaemia"@en,
        "natural killer cell leukemia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:breast_cyst rdfs:subClassOf :breast_benign_neoplasm ;
    :has_definition "A breast benign neoplasm that is characterized by a fluid-filled sac." ;
    :has_exact_synonym "Cyst of the breast"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:breast_fibroadenosis rdfs:subClassOf :breast_benign_neoplasm ;
    :has_definition "A breast benign neoplasm that has_material_basis_in fibrous tissue and epithelial tissue in which tumor cells form glands or glandlike structures." ;
    :has_exact_synonym "Fibroadenosis - breast"@en,
        "Fibroadenosis of breast"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fibrosclerosis_of_breast rdfs:subClassOf :non_proliferative_fibrocystic_change_of_the_breast ;
    :has_definition "A non-proliferative fibrocystic change of the breast that contains scar tissue." ;
    :has_exact_synonym "Fibrosis of the breast"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:breast_fibrocystic_disease rdfs:subClassOf :breast_benign_neoplasm ;
    :has_definition "A breast benign neoplasm that has_material_basis_in fibrous tissue and is characterized by the development of cystic spaces." ;
    :has_exact_synonym "Diffuse cystic mastopathy"@en,
        "Fibrocystic disease of breast"@en,
        "breast Fibrocystic Change"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_leukemia rdfs:subClassOf :leukemia ;
    :has_definition "A leukemia that develops slowly." ;
    :has_related_synonym "CLL"@en,
        "CML"@en,
        "adult chronic leukemia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:eosinophilic_meningitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dizziness ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :paresthesia ],
        :chronic_meningitis ;
    :has_definition "A chronic meningitis that is characterized by the presence of 10 or more eosinophils/microL in the cerebrospinal fluid (CSF) or a CSF eosinophilia of at least 10 percent. Symptoms of this condition range from mild headache to severe, throbbing headache, dizziness, nausea, vomiting, fever, neck stiffness, paresthesia, and stabbing pain in the trunk and limbs aggravated by touch." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:epididymis_cancer rdfs:subClassOf :epididymis_disease,
        :male_reproductive_organ_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :epididymis ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A male reproductive organ cancer that is located in the epididymis." ;
    :has_exact_synonym "malignant Epididymal tumor"@en,
        "malignant neoplasm of epididymis"@en,
        "malignant tumor of epididymis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:epididymis_adenocarcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :epithelial_cell ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_origin ;
                                            owl:someValuesFrom :gland ] ;
                                    rdf:rest :nil ] ] ] ],
        :adenocarcinoma,
        :epididymis_cancer ;
    :has_definition "An epididymis cancer that derives_from epithelial cells of glandular origin." ;
    :has_related_synonym "adenocarcinoma of the epididymis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lymphoid_leukemia rdfs:subClassOf :leukemia ;
    :has_definition "A leukemia that has_material_basis_in a B-cell or T-cell lineage involving primarily the bone marrow and the peripheral blood." ;
    :has_exact_synonym "lymphoblastic leukaemia"@en,
        "lymphoblastic leukemia"@en,
        "lymphocytic leukaemia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:yaws rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :skin_lesion ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :zone_of_skin ;
                            rdf:rest [ rdf:first :bone_element ;
                                    rdf:rest [ rdf:first :articulation ;
                                            rdf:rest :nil ] ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :contact_transmission ],
        :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that results in infection located in skin, located in joint or located in bone, has_material_basis_in Treponema pallidum subsp pertenue, which is transmitted by direct skin contact with an infected person. The infection has symptom skin lesions." ;
    :has_exact_synonym "Bouba"@en,
        "frambesia"@en,
        "frambesia tropica"@en,
        "frambosie"@en,
        "polypapilloma tropicum"@en,
        "thymosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:strabismic_amblyopia rdfs:subClassOf :amblyopia ;
    :has_definition "An amblyopia that is characterized by strabismus or eye misalignment. The brain begins to ignore the eye that is not straight and the vision subsequently drops in that eye." ;
    :has_exact_synonym "suppression amblyopia" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:amblyopia rdfs:subClassOf :eye_disease ;
    :has_definition "An eye disease that is characterized by poor vision in one eye resulting from the brain failing to process inputs from one eye and over time favors the other eye. The weaker or lazy eye often wanders inward or outward." ;
    :has_exact_match "MESH:D000550" ;
    :has_exact_synonym "lazy eye" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:refractive_amblyopia rdfs:subClassOf :amblyopia ;
    :has_definition "An amblyopia that is characterized by refractive error in one or both eyes that is not corrected early in childhood resulting in poor development of the visual function in the affected eye(s)." ;
    :has_exact_synonym "ametropic amblyopia" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:deprivation_amblyopia rdfs:subClassOf :amblyopia ;
    :has_definition "An amblyopia that is characterized by a structural anomaly that impairs vision like a droopy eyelid or an opacity in the eye, such as a cataract or corneal scar." ;
    :has_exact_synonym "disuse amblyopia" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:amyotrophic_neuralgia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :brachial_plexus_neuropathy ;
    :has_definition "A brachial plexus neuropathy that is characterized by acute, recurrent episodes of brachial plexus neuropathy with muscle weakness and atrophy preceded by severe pain in the affected arm, and that has_material_basis_in heterozygous mutation in the SEPT9 gene on chromosome 17q25." ;
    :has_exact_synonym "neuralgic amyotrophy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:prolymphocytic_leukemia rdfs:subClassOf :chronic_lymphocytic_leukemia ;
    :has_definition "A chronic lymphocytic leukemia that is characterized by the presence of medium-sized lymphocytes with visible nucleoli (prolymphocytes) in the peripheral blood, bone marrow, and spleen." ;
    :has_exact_synonym "PLL",
        "Prolymphocytic leukaemia" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:secondary_hypertrophic_osteoarthropathy rdfs:subClassOf :arthropathy ;
    :has_exact_synonym "Bamberger-Marie disease"@en,
        "HPOA - hypertrophic pulmonary osteoarthropathy"@en,
        "Marie Bamberger disease"@en,
        "hypertrophic pulmonary osteoarthropathy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pneumonic_plague rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chills ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :breathing_problems ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :lung ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :flea_borne_transmission ],
        :lung_disease,
        :plague ;
    :has_definition "A plague that results_in infection located_in lung, which results from direct inhalation of the bacillus and has_symptom fever, has_symptom chills, has_symptom cough and has_symptom difficulty breathing." ;
    :has_exact_synonym "primary pneumonic plague"@en,
        "secondary pneumonic plague"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:seminal_vesicle_chronic_gonorrhea rdfs:subClassOf :gonococcal_seminal_vesiculitis ;
    :has_exact_synonym "Gonococcal seminal vesiculitis, chronic"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bacterial_infectious_disease rdfs:subClassOf :disease_by_infectious_agent ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_material_basis_in ;
                                    owl:someValuesFrom :bacteria ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A disease by infectious agent that results_in infection, has_material_basis_in Bacteria." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_lymphocytic_leukemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :lymphocyte_of_b_lineage ],
        :lymphoid_leukemia,
        :lymphoma ;
    :has_definition "A lymphocytic leukemia characterized by over production of B-cells and their accumulation in bone marrow and blood." ;
    :has_exact_synonym "B-cell chronic lymphocytic leukaemia"@en,
        "B-cell chronic lymphocytic leukemia"@en,
        "CLL"@en,
        "chronic lymphatic leukaemia"@en,
        "chronic lymphatic leukemia"@en,
        "chronic lymphocytic leukaemia"@en,
        "lymphoplasmacytic leukaemia"@en,
        "lymphoplasmacytic leukemia"@en ;
    :has_related_synonym "B-cell chronic lymphoid leukemia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gonococcal_seminal_vesiculitis rdfs:subClassOf :gonorrhea,
        :vesiculitis ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :gonorrhea ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :seminal_vesicle ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Gonorrhea of seminal vesicle"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_pericementitis rdfs:subClassOf :periodontitis ;
    :has_exact_synonym "acute periodontitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:klippel_feil_syndrome rdfs:subClassOf [ owl:intersectionOf [ rdf:first :physical_disorder ;
                    rdf:rest [ rdf:first [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :disease_has_basis_in ;
                                                    owl:someValuesFrom :symptom ] ;
                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                            owl:onProperty :disease_has_location ;
                                                            owl:someValuesFrom :vertebral_column ] ;
                                                    rdf:rest :nil ] ] ] ;
                            rdf:rest :nil ] ] ],
        :physical_disorder,
        :spinal_disease,
        :syndrome ;
    :has_definition "A physical disorder that is characterized by abnormal segmentation of the vertebra during fetal development which results in fusion located in cervical vertebra." ;
    :has_exact_synonym "Klippel-Feil and Turner syndrome"@en,
        "Klippel-Feil deformity, deafness and facial asymmetry"@en,
        "autosomal dominant Klippel-Feil syndrome"@en,
        "congenital dystrophia brevicollis"@en,
        "congenital synostosis of cervical vertebrae"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:stable_condition_keratoconus rdfs:subClassOf :keratoconus ;
    :has_exact_synonym "Keratoconus, stable condition"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:purulent_acute_otitis_media rdfs:subClassOf :suppurative_otitis_media ;
    :has_definition "A suppurative otitis media with sudden onset and a short course." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mooren_s_ulcer rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :corneal_ulcer ;
    :has_definition "A corneal ulcer that is characterized by painful peripheral corneal ulceration, sterile limbal inflammation, and episcleral and conjunctival edema." ;
    :has_exact_synonym "Mooren ulcer"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mycotic_corneal_ulcer rdfs:subClassOf :corneal_ulcer ;
    :has_definition "A corneal ulcer that is characterized by ulceration of the cornea secondary to fungal infection and is caused by minor trauma and subsequent infection by mycotic organisms, such as candida, aspergillus, fusarium, and rhizopus." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:marginal_corneal_ulcer rdfs:subClassOf :corneal_ulcer ;
    :has_definition "A corneal ulcer that is characterized by infiltrate formation in the marginal zone that is parallel but separated from the limbus." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ring_corneal_ulcer rdfs:subClassOf :corneal_ulcer ;
    :has_definition "A corneal ulcer that is characterized by a ring of infiltration and/or ulceration that forms on the cornea." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:perforated_corneal_ulcer rdfs:subClassOf :corneal_ulcer ;
    :has_definition "A corneal ulcer that has progressed and thinned the cornea such that the cornea ruptures, leaving a small hole that may drain or appear to contain pigment." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tonsillitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dysphagia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pharynx_inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chills ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormality_of_the_tonsils ],
        :upper_respiratory_tract_disease ;
    :has_definition "An upper respiratory tract disease which is characterized by inflammation of the tonsils resulting from bacterial (Group A streptococcus) and viral (Epstein-Barr virus, adenovirus) infections. Symptoms include a severe sore throat, painful or difficult swallowing, coughing, headache, myalgia, fever and chills." ;
    :has_exact_synonym "Throat infection - tonsillitis"@en,
        "chronic tonsillitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:legionnaires_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chills ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :droplet_spread_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :pneumonia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        :legionellosis ;
    :has_definition "A legionellosis that is characterized by severe form of infection producing pneumonia. Symptoms include fever, chills, and cough." ;
    :has_exact_synonym "Infection by Legionella pneumophilia"@en,
        "Legionella"@en,
        "Legionella pneumonia"@en,
        "Legionnaire's disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:legionellosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :legionella_pneumophila ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :droplet_spread_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dry_cough ],
        :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that results_in infection located_in respiratory tract, has_material_basis_in Legionella pneumophila, which is transmitted_by inhalation of droplets containing bacteria. The symptoms include dry cough, fever, headache and diarrhea." ;
    :has_exact_synonym "Legionella infection"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:common_cold rdfs:subClassOf :upper_respiratory_tract_disease ;
    :has_definition "An upper respiratory tract disease which involves inflammation of the mucous membranes of the nose, throat, eyes, and eustachian tubes with watery then purulent discharge. This is an acute contagious disease caused by rhinoviruses, human parainfluenza viruses, human respiratory syncytial virus, influenza viruses, adenoviruses, enteroviruses, or metapneumovirus." ;
    :has_exact_synonym "Acute viral rhinopharyngitis"@en,
        "Nasopharyngitis - acute"@en,
        "Nasopharyngitis, acute"@en,
        "acute coryza"@en,
        "acute nasopharyngitis"@en,
        "acute rhinitis"@en,
        "rhino-sinusitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nasopharyngitis rdfs:subClassOf :nasopharyngeal_disease ;
    :has_definition "A nasopharyngeal disease which involves inflammation of the nasal passages and upper part of the pharynx." ;
    :has_exact_synonym "chronic nasopharyngitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dentin_caries rdfs:subClassOf :dental_caries ;
    :has_exact_synonym "Compound dental caries"@en,
        "Dental caries extending into dentine"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:patellar_tendinitis rdfs:subClassOf :tendinitis ;
    :has_exact_synonym "Patellar tendonitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diaphragm_disease rdfs:subClassOf :muscular_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :diaphragm ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A muscular disease that is located_in the diaphragm." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:esophageal_atresia rdfs:subClassOf :esophageal_disease ;
    :has_exact_synonym "Congenital atresia of esophagus"@en,
        "Congenital imperforate esophagus"@en,
        "Imperforate esophagus"@en,
        "Oesophageal atresia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hirschsprung_s_disease rdfs:subClassOf :megacolon ;
    :has_definition "A megacolon that is characterized by a blockage of the large intestine due to improper muscle movement in the bowel." ;
    :has_exact_synonym "Hirschsprung disease"@en,
        "aganglionic megacolon"@en,
        "congenital megacolon"@en,
        "macrocolon"@en,
        "pelvirectal achalasia"@en,
        "total intestinal aganglionosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:imperforate_anus rdfs:subClassOf :anus_disease,
        :physical_disorder ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :physical_disorder ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :anus ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Congenital atresia of anus"@en,
        "Congenital or infantile occlusion of anus"@en,
        "anal atresia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adrenal_cortical_hypofunction rdfs:subClassOf :adrenal_cortex_disease ;
    :has_exact_synonym "Adrenal Cortical Insufficiency"@en,
        "Corticoadrenal insufficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:orbital_granuloma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :granuloma ],
        :chronic_orbital_inflammation .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dressler_s_syndrome rdfs:subClassOf :pericarditis ;
    :has_definition "A pericarditis characterized by inflammation, occurring after injury, located_in pericardium." ;
    :has_exact_synonym "Dressler syndrome"@en,
        "Postmyocardial infarction syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:malignant_otitis_externa rdfs:subClassOf :otitis_externa ;
    :has_definition "An otitis externa which involves infection of the external ear that has spread to involve the skull bone containing part of the ear canal, the middle ear, and the inner ear. It is caused by the bacteria Pseudomonas. This is common in people with weakened immune systems and in older people with diabetes." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:beach_ear rdfs:subClassOf :otitis_externa ;
    :has_definition "An otitis externa which is a microbial infection that occurs suddenly, rapidly worsens, and becomes very painful and alarming. It is caused by swimming in polluted water, scratching the ear or inside the ear and object stuck in the ear. It is occasionally associated with middle ear infection or upper respiratory infections such as colds." ;
    :has_exact_synonym "Tank ear"@en,
        "acute bacterial inflammation of external ear"@en,
        "acute otitis externa, diffuse"@en,
        "acute swimmer's ear"@en,
        "acute swimmers' ear"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_fungal_otitis_externa rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :fungi ],
        :fungal_infectious_disease,
        :otomycosis ;
    :has_definition "A otomycosis which is persistent and long-lasting or recurrent." ;
    :has_exact_synonym "chronic mycotic otitis externa"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_infection_of_pinna rdfs:subClassOf :otitis_externa ;
    :has_definition "An otitis externa which involves bacterial infections often related to underlying comorbidities as well as trauma. Common sources of trauma include ear piercing, boxing, blunt trauma, burns, bite wounds and iatrogenic insults. The common bacterial pathogens are staphylococcal and streptococcal species." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:double_pterygium rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :loss_of_vision ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :astigmatism ],
        :pterygium ;
    :has_definition "A pterygium that is characterized by a fleshy outpouching of conjunctival growth that appears to have multiple heads or areas of bulk or origin and has_symptom multiple fleshy bumps on the surface of the eye, foreign body sensation, decreased vision, and astigmatism. Double pterygiums are more common in people prone to ocular surface injury, such as those living in sunny, hot, and dry climates. Double pterygiums progress from pinguecula." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:conjunctival_pterygium rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :loss_of_vision ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :conjunctiva ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :astigmatism ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :conjunctival_degeneration ],
        :conjunctival_disease,
        :pterygium ;
    :has_definition "A pterygium that is characterized by conjunctival degeneration, a fleshy outpouching of conjunctival growth and has_symptom fleshy bumps on the surface of the eye, foreign body sensation, decreased vision, and astigmatism. Conjunctival pterygiums are more common in people prone to ocular surface injury, such as those living in sunny, hot, and dry climates. Conjunctival pterygiums progress from pinguecula." ;
    :has_exact_synonym "Web eye"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:viral_pneumonia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :lung ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :pneumonia ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :viruses ],
        :pneumonia,
        :viral_infectious_disease ;
    :has_definition "A pneumonia described as an inflammatory illness of the lung commonly caused by viruses such as influenza virus, parainfluenza, adenovirus, rhinovirus, herpes simplex virus, respiratory syncytial virus, hantavirus, and cytomegalovirus." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:stomach_cancer rdfs:subClassOf :gastrointestinal_system_cancer,
        :stomach_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :stomach ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A gastrointestinal system cancer that is located_in the stomach." ;
    :has_exact_synonym "gastric cancer"@en,
        "gastric neoplasm"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:malignant_gastric_granular_cell_tumor rdfs:subClassOf :stomach_cancer ;
    :has_exact_synonym "malignant gastric granular cell tumour"@en,
        "malignant granular cell tumor of stomach"@en,
        "malignant granular cell tumour of stomach"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gastric_fundus_cancer rdfs:subClassOf :stomach_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :fundus_of_stomach ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A stomach cancer that is located_in the gastric fundus." ;
    :has_exact_synonym "Ca fundus - stomach"@en,
        "malignant neoplasm of fundus of stomach"@en,
        "malignant tumor of fundus of stomach"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gastric_lymphoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :lymphocyte ],
        :lymphoma,
        :stomach_cancer ;
    :has_exact_synonym "Lymphoma of the stomach"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:microinvasive_gastric_cancer rdfs:subClassOf :gastric_adenocarcinoma ;
    :has_exact_synonym "Surface gastric cancer"@en,
        "early gastric cancer"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pylorus_cancer rdfs:subClassOf :stomach_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :pylorus ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Ca pylorus - stomach"@en,
        "malignant neoplasm of Prepylorus"@en,
        "malignant neoplasm of pylorus of stomach"@en,
        "malignant tumor of pylorus"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pyloric_antrum_cancer rdfs:subClassOf :pylorus_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :pyloric_antrum ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "malignant neoplasm of antrum of stomach"@en,
        "malignant tumor of pyloric antrum"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cardia_cancer rdfs:subClassOf :stomach_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :cardia_of_stomach ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A cancer located_in the gastric cardia." ;
    :has_exact_synonym "Ca cardia - stomach"@en,
        "malignant neoplasm of cardia of stomach"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_eustachian_salpingitis rdfs:subClassOf :otosalpingitis ;
    :has_definition "A otosalpingitis with a sudden onset and a short course." ;
    :has_exact_synonym "acute eustachian tube salpingitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:meningoencephalitis rdfs:subClassOf :central_nervous_system_disease ;
    :has_definition "A central nervous system disease that involves encephalitis which occurs along with meningitis." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:supine_hypotensive_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :shock ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vascular_alteration ],
        :vascular_disease ;
    :has_definition "A vascular disease that is characterized by severe supine hypotension in late pregnancy, whose clinical presentation ranges from minimal cardiovascular alterations to severe shock, resulting from inferior vena cava compression by gravid uterus." ;
    :has_exact_synonym "antepartum maternal hypotension syndrome"@en,
        "postpartum maternal hypotension syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oculocerebrorenal_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :syndrome,
        :x_linked_recessive_disease ;
    :has_definition "A syndrome that has_material_basis_in mutation in the OCRL gene on chromosome Xq26 and that is characterized by hydrophthalmia, cataract, mental retardation, vitamin D-resistant rickets, amino aciduria, and reduced ammonia production by the kidney." ;
    :has_exact_synonym "Lowe syndrome"@en,
        "lowe oculocerebrorenal syndrome"@en,
        "oculocerebrorenal syndrome of Lowe"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:late_yaws rdfs:subClassOf :yaws ;
    :has_definition "A yaws that appears after five years of the initial infection and is characterized by disabling consequences of the nose, bones and palmar/plantar hyperkeratosis." ;
    :has_exact_synonym "Gummata and ulcers due to yaws"@en,
        "Gummata of yaws"@en,
        "Ulcers of yaws"@en,
        "Yaws gummata and ulcers"@en,
        "gummatous frambeside"@en,
        "multiple papillomata due to yaws and wet crab yaws"@en,
        "nodular late yaws"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:early_yaws rdfs:subClassOf :yaws ;
    :has_definition "A yaws that results in initial papule at the site of entry of bacteria. Without treatment, this is followed by disseminated skin lesions over the body. Bone pain and bone lesions may also occur." ;
    :has_exact_synonym "Frambesia, initial or primary"@en,
        "Initial frambesial ulcer"@en,
        "Initial lesions of yaws"@en,
        "bone and joint lesions due to yaws"@en,
        "bone and joint yaws lesion"@en,
        "chancre of yaws"@en,
        "primary frambesia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:osteomalacia rdfs:subClassOf :bone_remodeling_disease ;
    :has_definition "A bone remodeling disease that has_material_basis_in a vitamin D deficiency which results_in softening located_in bone." ;
    :has_exact_match "MESH:D010018" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:leukodystrophy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :cerebrum ],
        :cerebral_degeneration ;
    :has_definition "A cerebral degeneration characterized by dysfunction of the white matter of the brain." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:metachromatic_leukodystrophy rdfs:subClassOf :sphingolipidosis ;
    :has_definition "A sphingolipidosis characterized by the accumulation of sulfatides in cells, especially the myelin producing cells of the nervous system." ;
    :has_exact_synonym "MLD"@en,
        "Scholz cerebral sclerosis"@en,
        "arylsulfatase A deficiency"@en,
        "deficiency of cerebroside-sulfatase"@en,
        "sulfatide lipoidosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:retinitis_pigmentosa rdfs:subClassOf :retinal_degeneration ;
    :has_definition "A retinal degeneration characterized by the gradual deterioration of the photoreceptors or the retinal pigment epithelium of the retina leading to progressive sight loss." ;
    :has_exact_synonym "pericentral pigmentary retinopathy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adrenoleukodystrophy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :leukodystrophy,
        :x_linked_recessive_disease ;
    :has_definition "A leukodystrophy that disrupts the breakdown of very-long-chain fatty acids resulting in progressive brain damage, failure of the adrenal glands and eventually death." ;
    :has_exact_match "MESH:D000326" ;
    :has_exact_synonym "ALD"@en,
        "Bronze Schilder disease"@en,
        "Encephalitis periaxialis concentrica"@en,
        "Encephalitis periaxialis, Schilder's"@en,
        "Siemerling-Creutzfeldt Disease"@en,
        "X-linked adrenoleukodystrophy"@en,
        "diffuse sclerosis"@en,
        "sudanophilic cerebral sclerosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intellectual_disability rdfs:subClassOf :specific_developmental_disorder ;
    :has_definition "A specific developmental disorder that involves significant limitations both in mental functioning and in adaptive behavior such as communicating, taking care of him or herself, and social skills." ;
    :has_related_synonym "mental retardation"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mild_pre_eclampsia rdfs:subClassOf :pre_eclampsia ;
    :has_definition "A pre-eclampsia characterized by the presence of hypertension without evidence of end-organ damage, in a woman who was normotensive before 20 weeks' gestation." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:charcot_marie_tooth_disease rdfs:subClassOf :neuromuscular_disease ;
    :has_definition "A neuromuscular disease that is characterized by a slowly progressive degeneration of the muscles of the foot, lower leg, hand and forearm." ;
    :has_exact_synonym "CMT - Charcot-Marie-Tooth disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pleural_tuberculosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pleural_effusion ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :allergic_reaction ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :pleura ],
        :allergic_disease,
        :extrapulmonary_tuberculosis,
        :pleural_disease ;
    :has_definition "An extrapulmonary tuberculosis that results_in lymphocyte-predominant exudative pleural effusion, located_in pleura. This results from an allergic response to tuberculoprotein causing the permeabiltity of the pleural vasculature to alter leading to a sub-pleural caseous focus rupture into the pleural sac." ;
    :has_exact_synonym "Pearly disease"@en,
        "Tuberculosis of pleura"@en,
        "Tuberculous pleurisy"@en,
        "Tuberculous pleuritis"@en,
        "tuberculous pleurisy in primary progressive tuberculosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hartnup_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :aminoaciduria ],
        :amino_acid_metabolic_disorder ;
    :has_definition "An amino acid metabolic disorder that is caused by abnormalities of the renal tubules and is characterized especially by aminoaciduria involving only monocarboxylic monoamines, a dry red scaly rash, and episodic muscular incoordination due to the effects of the disease on the cerebellum." ;
    :has_exact_synonym "Neutral 1 amino acid transport defect"@en,
        "deficiency of tryptophan oxygenase"@en,
        "neutral amino acid transport defect"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_tic_disorder rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :phonic_tics ],
        :tic_disorder ;
    :has_definition "A tic disorder that is characterized by single or multiple motor or phonic tics, but not both, which are present for more than a year." ;
    :has_exact_synonym "chronic motor or vocal tic disorder"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:glucose_intolerance rdfs:subClassOf :hyperglycemia ;
    :has_exact_synonym "Glucose malabsorption"@en,
        "Malabsorption of glucose"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lactose_intolerance rdfs:subClassOf :carbohydrate_metabolic_disorder ;
    :has_definition "A carbohydrate metabolic disorder that is characterized by the impaired ability to digest lactose." ;
    :has_exact_match "MESH:D007787" ;
    :has_exact_synonym "LM - Lactose malabsorption"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:short_bowel_syndrome rdfs:subClassOf :intestinal_disease ;
    :has_definition "An intestinal disease that is characterized by a reduced ability to absorb nutrients due to the physical loss or the loss of function of a portion of the small and/or large intestine." ;
    :has_exact_synonym "acquired short bowel syndrome"@en,
        "short gut syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:blind_loop_syndrome rdfs:subClassOf :intestinal_disease ;
    :has_definition "An intestinal disease characterized by a dysbalance of the bacterial flora of the small intestine, causing derangement to the normal physiological processes of digestion and absorption." ;
    :has_exact_synonym "Bacterial overgrowth syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tropical_sprue rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :steatorrhea ],
        :intestinal_disease ;
    :has_exact_synonym "Sprue - tropical"@en,
        "Tropical steatorrhea"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:celiac_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :constipation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        :autoimmune_disease_of_gastrointestinal_tract ;
    :has_definition "An autoimmune disease of gastrointestinal tract that is caused by a reaction located_in small intestine to gliadin, a prolamin (gluten protein) found in wheat, and similar proteins found in the crops of the tribe Triticeae. The disease is associated with HLA-DQ gene. It has_symptom abdominal pain, has_symptom constipation, has_symptom diarrhea, has_symptom nausea and vomiting, and has_symptom loss of appetite." ;
    :has_exact_synonym "celiac sprue"@en,
        "coeliac disease"@en,
        "idiopathic steatorrhea"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rickets rdfs:subClassOf :bone_remodeling_disease ;
    :has_definition "A bone remodeling disease that has_material_basis_in impaired mineralization or calcification of bones before epiphyseal closure due to deficiency or impaired metabolism of vitamin D, phosphorus or calcium which results_in softening and deformity located_in bone." ;
    :has_exact_match "MESH:D012279" ;
    :has_exact_synonym "active rickets"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pancreatic_steatorrhea rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :steatorrhea ],
        :pancreas_disease ;
    :has_exact_synonym "pancreatic steatorrhoea"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:protein_losing_enteropathy rdfs:subClassOf :intestinal_disease ;
    :has_exact_synonym "Enteropathy, exudative"@en,
        "Exudative enteropathy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:allergic_urticaria rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :allergic_reaction ],
        :allergic_disease,
        :urticaria ;
    :has_definition "An urticaria that is characterized by erythematous papules and plaques, has_symptom pruritis, and has_material_basis_in allergic reaction." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_gonococcal_cervicitis rdfs:subClassOf :acute_cervicitis ;
    :has_definition "An acute cervicitis that is caused by gonorrhea." ;
    :has_exact_synonym "Gonococcal cervicitis"@en,
        "acute gonorrhea of cervix"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_cervicitis rdfs:subClassOf :cervicitis ;
    :has_definition "A cervicitis that is characterized by onset within the past 1 - 3 days." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

