                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :lymph_node ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A lymphatic system cancer that is located_in the lymph node." ;
    :has_exact_synonym "lymph node neoplasm"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fanconi_syndrome rdfs:subClassOf :renal_tubular_transport_disease ;
    :has_definition "A renal tubular transport disease of the proximal renal tubes characterized by glucosuria, phosphaturia, generalized aminoaciduria and HCO3 wasting." ;
    :has_exact_match "MESH:D005198" ;
    :has_exact_synonym "Congenital Fanconi syndrome"@en,
        "De Toni-Fanconi syndrome"@en,
        "Fanconi-de Toni syndrome"@en,
        "Fanconi-de-Toni syndrome"@en,
        "Infantile nephropathic cystinosis"@en,
        "Lignac-Fanconi syndrome"@en,
        "adult Fanconi Anemia"@en,
        "adult Fanconi syndrome"@en,
        "deToni Fanconi syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:microphthalmia rdfs:subClassOf :eye_disease ;
    :has_definition "An eye disease where one or both eyeballs are abnormally small." ;
    :has_exact_synonym "microphthalmos"@en,
        "simple microphthalmos"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

