    :has_definition "A syndrome that is characterized by diabetes mellitus, optic atrophy, and deafness." ;
    :has_exact_synonym "WFS",
        "WS" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cystinosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :lysosomal_storage_disease ;
    :has_definition "A lysosomal storage disease characterized by the abnormal accumulation of cystine in the lysosomes. It follows an autosomal recessive inheritance pattern and that has_material_basis_in mutations in the CTNS gene, located on chromosome 17." ;
    :has_exact_synonym "cystine storage disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:schizotypal_personality_disorder rdfs:subClassOf :personality_disorder ;
    :has_definition "A personality disorder that involves a need for social isolation, anxiety in social situations, odd behavior and thinking, and often unconventional beliefs." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alzheimer_s_disease rdfs:subClassOf :tauopathy ;
    :has_definition "A tauopathy that is characterized by memory lapses, confusion, emotional instability and progressive loss of mental ability and results in progressive memory loss, impaired thinking, disorientation, and changes in personality and mood starting and leads in advanced cases to a profound decline in cognitive and physical functioning and is marked histologically by the degeneration of brain neurons especially in the cerebral cortex and by the presence of neurofibrillary tangles and plaques containing beta-amyloid." ;
    :has_exact_synonym "Alzheimer disease"@en,
        "Alzheimers dementia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lipoma_of_colon rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :colon ],
        :colonic_disease,
        :large_intestine_lipoma ;
    :has_exact_synonym "Colonic Lipoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:colon_leiomyoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :smooth_muscle_cell ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :colon ],
        :colonic_disease ;
    :has_exact_synonym "Colonic leiomyoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:colonic_lymphangioma rdfs:subClassOf :colonic_benign_neoplasm ;
    :has_exact_synonym "Lymphangioma of colon"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:residual_stage_of_open_angle_glaucoma rdfs:subClassOf :open_angle_glaucoma ;
    :has_exact_synonym "Open-angle glaucoma residual stage"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

