    :has_definition "A malignant mediastinal neurogenic neoplasm that has_material_basis_in immature nerve cells." ;
    :has_exact_synonym "neuroblastoma of mediastinum"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mediastinum_ganglioneuroblastoma rdfs:subClassOf :malignant_mediastinal_neurogenic_neoplasm ;
    :has_exact_synonym "Ganglioneuroblastoma of mediastinum"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:open_angle_glaucoma rdfs:subClassOf :glaucoma ;
    :has_definition "A glaucoma characterized by optic nerve damage resulting in progressive loss of visual field and increased pressure in the eye due to trabecular blockage." ;
    :has_exact_synonym "Wide-angle glaucoma"@en,
        "glaucoma simplex"@en,
        "open angle glaucoma"@en,
        "pigmentary glaucoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:juvenile_glaucoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :young_adult_onset ],
        :autosomal_dominant_disease,
        :primary_open_angle_glaucoma ;
    :has_definition "A primary open angle glaucoma early age of onset, rapidly progressive with more severely elevated and fluctuating intraocular pressures." ;
    :has_exact_synonym "Glaucoma of childhood"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:separation_anxiety_disorder rdfs:subClassOf :anxiety_disorder ;
    :has_definition "An anxiety disorder that involves the feeling of excessive and inappropriate levels of anxiety over being separated from a person to whom the individual has a strong emotional attachment or place." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lactocele rdfs:subClassOf :breast_cyst ;
    :has_definition "A breast cyst that develops during or shortly after lactation and is characterized by retention of milk or a milky substance that is usually located_in the mammary glands." ;
    :has_exact_synonym "Galactocele"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypertrophy_of_breast rdfs:subClassOf :breast_disease ;
    :has_definition "A breast disease that is characterized by the progressive, excessive enlargement of breast connective tissue." ;
    :has_exact_synonym "breasts enlarged"@en,
        "large breast"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mastitis rdfs:subClassOf :breast_disease ;
    :has_definition "A breast disease characterized by painful infection of the breast tissue." ;
    :has_exact_synonym "Inflammatory breast disease"@en,
        "Inflammatory disease of breast"@en,
        "breast inflammation"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fat_necrosis_of_breast rdfs:subClassOf :breast_disease ;
    :has_definition "A breast disease that is characterized by the death of breast adipocytes, usually secondary to injury." ;
    :has_exact_synonym "breast Fat necrosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:paragonimiasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :paragonimus ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :urticaria ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hemoptysis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_pain ],
        [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :disease_has_location ;
                            owl:someValuesFrom :brain ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :spleen ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :disease_has_location ;
                                            owl:someValuesFrom :liver ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hepatosplenomegaly ],
        :brain_disease,
        :liver_disease,
        :parasitic_helminthiasis_infectious_disease,
        :splenic_disease ;
    :has_definition "A parasitic helminthiasis infectious disease that involves parasitic infection by flukes of the genus Paragonimus. In the acute phase, the symptoms are diarrhea, abdominal pain, fever, cough, urticaria, hepatosplenomegaly, pulmonary abnormalities, and eosinophilia. Pulmonary manifestations include cough, expectoration of discolored sputum, hemoptysis, and chest radiographic abnormalities. Various organs like brain, spleen and liver can be infected." ;
    :has_exact_synonym "Infection by Paragonimus"@en,
        "lung fluke disease"@en,
        "lung fluke infection"@en,
        "pulmonary paragonimiasis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_open_angle_glaucoma rdfs:subClassOf :open_angle_glaucoma ;
    :has_definition "An open-angle glaucoma that is characterized by the absence of any apparent obstruction of aqueous outflow through the trabecular meshwork with gonioscopy, but often with elevated intraocular pressure." ;
    :has_exact_synonym "chronic simple glaucoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:giardiasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bloating ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :giardia_intestinalis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :steatorrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        :parasitic_protozoa_infectious_disease ;
    :has_definition "A parasitic protozoa infectious disease that involves infection of the small intestine by a single-celled enteric protozoan parasite Giardia intestinalis. The symptoms include greasy and malodorous stools, diarrhea, abdominal pain, bloating, nausea, and vomiting." ;
    :has_exact_synonym "Infection by Giardia lamblia"@en,
        "beaver feaver"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

