    owl:equivalentClass [ owl:intersectionOf [ rdf:first :hypertension ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :kidney ] ;
                            rdf:rest :nil ] ] ] .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:kidney_failure rdfs:subClassOf :kidney_disease ;
    :has_definition "A kidney disease characterized by the failure of the kidneys to adequately filter waste products from the blood." ;
    :has_exact_synonym "renal failure"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

