    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :broad_ligament_of_uterus ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A uterine adnexa cancer that is located_in the broad ligament." ;
    :has_exact_synonym "malignant neoplasm of broad ligament of uterus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:otitis_media rdfs:subClassOf :middle_ear_disease ;
    :has_definition "A otitis which involves inflammation of the middle ear." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

