    :has_definition "An osteomyelitis that has_material_basis_in infection located_in petrous part of temporal bone." ;
    :has_exact_synonym "acute petrositis"@en,
        "chronic petrositis"@en ;
    :has_related_synonym "inflammation of petrous bone"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypertension rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :high_blood_pressure ],
        :artery_disease ;
