    :has_exact_synonym "HTN"@en,
        "hyperpiesia"@en,
        "vascular hypertensive disorder"@en ;
    :has_related_synonym "hypertensive disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thrombotic_thrombocytopenic_purpura rdfs:subClassOf :thrombophilia ;
    :has_exact_synonym "Moschcowitz's syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bubonic_plague rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :prostration ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :flea_borne_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :lymph_node ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :lymphadenitis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chills ],
