        "Lateral rectus muscle innervation disorder"@en,
        "Sixth cranial nerve disorder"@en,
        "Sixth nerve palsy"@en,
        "VIth nerve Paralysis"@en,
        "VIth nerve disorder"@en,
        "abducens nerve disease"@en,
        "abducens palsy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

