@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:age_related_macular_degeneration rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :degeneration_of_macula_and_posterior_pole ;
    :has_definition "A degeneration of macula and posterior pole that is characterized by a loss of vision in the center of the visual field (the macula) resulting from damage to the retina and resulting in blurring of the sharp central vision." ;
    :has_exact_synonym "Age Related Maculopathies"@en,
        "Age Related Maculopathy"@en,
        "Senile macular degeneration"@en,
        "Senile macular retinal degeneration"@en,
        "age-related macular degeneration"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:kuhnt_junius_degeneration rdfs:subClassOf :degeneration_of_macula_and_posterior_pole ;
