            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :droplet_spread_transmission ],
        :leprosy ;
    :has_definition "A leprosy that results in early cutaneous lesions which consist of pale macules that are small, diffuse, and symmetric. This form of leprosy is characterized by hypoesthesia over extensor surfaces of the distal extremities, alopecia affecting lateral aspects of the eyebrows, saddle-nose deformity and oral lepromas." ;
    :has_exact_synonym "type L leprosy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

