    :has_exact_synonym "North Asian tick fever"@en,
        "North Asian tick typhus"@en,
        "Rickettsia sibirica spotted fever"@en,
        "manchurian typhus"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sickle_cell_anemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :blood_protein_disease ;
