    :has_exact_synonym "Hb SC disease"@en,
        "Hb-S/Hb-C disease"@en,
        "Hb-SS disease without crisis"@en,
        "Hemoglobin S disease without crisis"@en,
        "Sickle-cell/Hb-C disease without crisis"@en,
        "drepanocytosis"@en,
        "haemoglobin SC disease"@en,
        "hemoglobin SC disease"@en,
        "sickle cell anaemia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

