    :has_definition "A personality disorder that is characterized by a pervasive psychological dependence on other people." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:obsessive_compulsive_personality_disorder rdfs:subClassOf :personality_disorder ;
    :has_definition "A personality disorder that is characterized by a pervasive pattern of preoccupation with orderliness, perfectionism, and mental and interpersonal control at the expense of flexibility, openness, and efficiency." ;
    :has_exact_synonym "OCPD"@en ;
    :has_related_synonym "Anankastic personality disorder"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:obsessive_compulsive_disorder rdfs:subClassOf :anxiety_disorder ;
    :has_definition "An anxiety disorder that involves unwanted and repeated thoughts, feelings, ideas, sensations (obsessions), or behaviors that make them feel driven to do something (compulsions)." ;
    :has_exact_synonym "Anancastic neurosis"@en,
        "obsessive compulsive disorder"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

