@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:impulse_control_disorder rdfs:subClassOf :disease_of_mental_health ;
    :has_definition "A disease of mental health that involves a failure to resist an impulsive act or behaviour that may be harmful to self or others." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:paranoid_personality_disorder rdfs:subClassOf :personality_disorder ;
    :has_definition "A personality disorder that is characterized by paranoia and a pervasive, long-standing suspiciousness and generalized mistrust of others." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:antisocial_personality_disorder rdfs:subClassOf :personality_disorder ;
    :has_definition "A personality disorder that involves a pervasive pattern of disregard for, and violation of, the rights of others that begins in childhood or early adolescence and continues into adulthood." ;
