@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spastic_diplegia rdfs:subClassOf :spastic_cerebral_palsy ;
    :has_definition "A spastic cerebral palsy that affects lower extremities resulting in tight leg and hip muscles. The legs cross at the knees, making it difficult to walk." ;
    :has_exact_synonym "Diplegic infantile cerebral palsy"@en,
        "Infantile spastic cerebral palsy"@en,
        "Little's disease"@en,
        "Littles disease"@en,
        "cerebral spastic infantile paralysis"@en,
        "infantile diplegic cerebral palsy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lipoid_nephrosis rdfs:subClassOf :nephrotic_syndrome ;
    :has_exact_synonym "Minimal Change Glomerulonephritis"@en,
        "Minimal change disease"@en,
        "Nephrotic syndrome with lesion of minimal change glomerulonephritis"@en,
        "Nephrotic syndrome with lesion of minimal change nephrotic syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spastic_hemiplegia rdfs:subClassOf :spastic_cerebral_palsy ;
    :has_definition "A spastic cerebral palsy that affects one side of the body resulting in stiff arm, hand and leg. On the affected side,the arm and leg may not develop normally." ;
    :has_exact_synonym "Congenital hemiplegia"@en,
        "Hemiplegic infantile cerebral palsy"@en,
        "hemiplegic cerebral palsy"@en,
        "spastic hemiplegic cerebral palsy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spastic_monoplegia rdfs:subClassOf :spastic_cerebral_palsy ;
    :has_definition "A spastic cerebral palsy that affects only one limb." ;
    :has_exact_synonym "Monoplegic infantile cerebral palsy"@en,
        "infantile monoplegic cerebral palsy"@en,
        "spastic monoplegic cerebral palsy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hemiplegia rdfs:subClassOf :central_nervous_system_disease ;
    :has_definition "A central nervous system disease that is characterized by the complete paralysis of half of the body." ;
    :has_exact_synonym "Infantile hemiplegia"@en,
        "Postnatal infantile hemiplegia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spastic_quadriplegic_cerebral_palsy rdfs:subClassOf :spastic_cerebral_palsy ;
    :has_definition "A spastic cerebral palsy that is characterized by non-progressive, variable spastic quadriparesis in multiple members of a family, in the absence of additional factors complicating pregnancy or birth, affecting all four limbs, and with difficulty with walking and talking." ;
    :has_exact_synonym "inherited congenital spastic quadriplegia",
        "inherited congenital spastic tetraplegia",
        "quadriplegic infantile cerebral palsy"@en,
        "spastic quadriplegia"@en,
        "tetraplegic infantile cerebral palsy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_salpingo_oophoritis rdfs:subClassOf :salpingo_oophoritis ;
    :has_exact_synonym "acute salpingitis and oophoritis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:salpingo_oophoritis rdfs:subClassOf :oophoritis ;
    :has_exact_synonym "Salpingitis/oophoritis"@en,
        "Tubo-ovarian inflammatory disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oophoritis rdfs:subClassOf :ovarian_disease ;
    :has_definition "An ovarian disease that is characterized by inflammation of the ovary." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:membranous_glomerulonephritis rdfs:subClassOf :glomerulonephritis ;
    :has_exact_synonym "membranous nephropathy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fetal_erythroblastosis rdfs:subClassOf :microcytic_anemia ;
    :has_exact_synonym "EF - Erythroblastosis foetalis"@en,
        "Haemolytic disease due to rhesus isoimmunisation"@en,
        "erythroblastosis fetalis"@en,
        "rhesus isoimmunisation of the newborn"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alport_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :gene ],
        :monogenic_disease,
        :syndrome ;
    :has_definition "A syndrome disease that is characterized by glomerulonephritis, endstage kidney disease, and hearing loss." ;
    :has_exact_synonym "Hereditary Nephritis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:conjunctival_vascular_disease rdfs:subClassOf :conjunctival_disease ;
    :has_exact_synonym "Conjunctival vascular abnormality"@en,
        "vascular abnormalities of conjunctiva"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alpha_thalassemia rdfs:subClassOf :thalassemia ;
    :has_definition "A thalassemia involving the genes HBA1and HBA2 hemoglobin genes." ;
    :has_exact_synonym "Alpha thalassaemia"@en,
        "alpha-Thalassemia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:basal_ganglia_cerebrovascular_disease rdfs:subClassOf :cerebrovascular_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cerebrovascular_disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :collection_of_basal_ganglia ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_match "MESH:D020144" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_hemorrhagic_leukoencephalitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hemorrhage ],
        :acute_disseminated_encephalomyelitis ;
    :has_definition "A very rare form of acute disseminated encephalomyelitis, characterized by a brief but intense attack of inflammation and necrotizing vasculitis of venules and hemorrhage, and edema." ;
    :has_exact_synonym "AHL"@en,
        "Weston-Hurst syndrome"@en,
        "acute haemorrhagic leucoencephalitis of Weston Hurst"@en,
        "acute hemorrhagic encephalomyelitis"@en,
        "acute necrotizing hemorrhagic leukoencephalitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:postinfectious_encephalitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormal_immunoglobulin_level ],
        :autoimmune_disease_of_central_nervous_system,
        :encephalitis ;
    :has_definition "An encephalitis that is characterized by the immune system mistakenly attacking healthy cells in the brain instead of attacking only the cells causing the infection, often occuring two to three weeks after the initial infection." ;
    :has_exact_synonym "secondary encephalitis",
        "Postinfective encephalitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immature_cataract rdfs:subClassOf :senile_cataract ;
    :has_definition "A senile cataract that is characterized by variable opacification of the lens of the eye with some clear lens fibers remaining." ;
    :has_exact_synonym "Incipient cataract"@en,
        "Incipient senile cataract"@en,
        "Water clefts"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lens_disease rdfs:subClassOf :eye_disease ;
    :has_definition "An eye disease that affects the lens of the eye, which is the transparent disc that focuses light to the photosensors in the back of the eye." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ovarian_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :female_reproductive_system_disease,
        :gonadal_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :ovary ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A female reproductive system disease that is located_in the ovary." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anorectal_stricture rdfs:subClassOf :anus_disease ;
    :has_exact_synonym "Stenosis of rectum and anus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:corneal_edema rdfs:subClassOf :corneal_disease ;
    :has_exact_synonym "Corneal oedema"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_rapidly_progressive_glomerulonephritis rdfs:subClassOf :glomerulonephritis ;
    :has_exact_synonym "chronic glomerulonephritis with lesion of rapidly progressive glomerulonephritis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dissociative_amnesia rdfs:subClassOf :dissociative_disorder ;
    :has_definition "A dissociative disorder where he continuity of the patient's memory is disrupted. Patients with dissociative amnesia have recurrent episodes in which they forget important personal information or events, usually connected with trauma or severe stress." ;
    :has_exact_synonym "psychogenic amnesia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:depersonalization_disorder rdfs:subClassOf :dissociative_disorder ;
    :has_definition "A dissociative disorder in which the sufferer is affected by persistent or recurrent feelings of depersonalization and/or derealization." ;
    :has_exact_synonym "Neurotic derealization"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:felty_s_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormal_immunoglobulin_level ],
        :autoimmune_disease,
        :syndrome ;
    :has_definition "A syndrome that results_in rheumatoid arthritis, splenomegaly and neutropenia." ;
    :has_exact_synonym "Felty syndrome"@en,
        "Rheumatoid arthritis with splenoadenomegaly and leukopenia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:meconium_aspiration_syndrome rdfs:subClassOf :lung_disease ;
    :has_definition "A lung disease that is characterized by a newborn breathing in a mixture of meconium and amniotic fluid into the lungs around the time of delivery." ;
    :has_exact_synonym "Neonatal aspiration of meconium"@en,
        "meconium aspiration"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:urinary_bladder_cancer rdfs:subClassOf :bladder_disease,
        :urinary_system_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :urinary_bladder ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An urinary system cancer that results_in malignant growth located_in the urinary bladder." ;
    :has_exact_synonym "bladder cancer"@en,
        "tumor of the bladder"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pasteurellosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :tachycardia ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :pasteurella_multocida ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :pneumonia ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :contact_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :joint_pain ],
        :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that results_in systemic infection, has_material_basis_in Pasteurella multocida, which is transmitted_by animal bite, scratch, or lick. The infection has_symptom joint pain has_symptom fever, has_symptom rigors, has_symptom pneumonia, has_symptom meningeal irritation, and has_symptom tachycardia." ;
    :has_exact_synonym "Pasteurella infection"@en,
        "Pasteurella infectious disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:esophagus_lymphoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :lymphocyte ],
        :esophageal_cancer,
        :lymphoma ;
    :has_exact_synonym "Lymphoma of esophagus"@en,
        "Lymphoma of oesophagus"@en,
        "oesophagus lymphoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:placenta_praevia rdfs:subClassOf :placenta_disease ;
    :has_definition "A placenta disease that is characterized by placenta attachment to the uterine wall close to or covering the cervix." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:esophageal_carcinoma rdfs:subClassOf [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :derives_from ;
                                    owl:someValuesFrom :epithelial_cell ] ;
                            rdf:rest :nil ] ] ],
        :carcinoma,
        :esophageal_cancer ;
    :has_definition "A esophageal cancer that has_material_basis_in abnormally proliferating cells derives_from epithelial cells." ;
    :has_exact_synonym "cancer of esophagus"@en,
        "cancer of oesophagus"@en,
        "carcinoma of esophagus"@en,
        "carcinoma of oesophagus"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brucella_suis_brucellosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diaphoresis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chills ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :malaise ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :anorexia ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :brucella_suis ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :hyperhidrosis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fatigue ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :joint_pain ],
        :brucellosis ;
    :has_definition "A brucellosis that involves an infection caused by Brucella suis [NCBITaxon:29461] in swine and humans. The disease has_symptom fever, has_symptom chills, has_symptom malaise, has_symptom diaphoresis, has_symptom arthralgia, has_symptom myalgia, has_symptom headache, has_symptom anorexia, and has_symptom fatigue." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brucellosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :backache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :joint_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :weakness ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :contact_transmission ;
                            rdf:rest [ rdf:first :vehicle_borne_ingestion_transmission ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :brucella ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fatigue ],
        :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that is caused by the bacteria of the genus Brucella, when humans come in contact with contaminated animals or animal products or ingestion of infected food products. The disease has_symptom fever, has_symptom sweat, has_symptom headache, has_symptom back pain, has_symptom physical weakness, has_symptom joint pain and has_symptom fatigue." ;
    :has_exact_synonym "Maltese fever"@en,
        "undulant fever"@en ;
    :has_related_synonym "Bang's disease"@en,
        "Gibraltar fever"@en,
        "Malta fever"@en,
        "Mediterranean fever"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:leech_infestation rdfs:subClassOf :parasitic_ectoparasitic_infectious_disease ;
    :has_definition "A parasitic ectoparasitic infectious disease that involves parasitic infestation by members of the subclass Hirudinea. The leeches remain attached to their hosts and feed on blood until they become full, at which point they fall off to digest. While feeding, they release an anesthetic and use a combination of mucus and suction to stay attached and secrete an anti-clotting enzyme, hirudin, into the host's blood stream." ;
    :has_exact_synonym "Hirudiniasis"@en,
        "Leeches"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:esophagus_melanoma rdfs:subClassOf :esophageal_cancer ;
    :has_exact_synonym "melanoma of esophagus"@en,
        "melanoma of oesophagus"@en,
        "oesophagus melanoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myiasis rdfs:subClassOf :parasitic_ectoparasitic_infectious_disease ;
    :has_definition "A parasitic ectoparasitic infectious disease that is caused by parasitic dipterous fly larvae (maggots) feeding on the host's necrotic or living tissue." ;
    :has_exact_synonym "Infestation by fly larvae"@en,
        "Infestation by maggots"@en,
        "Maggot infestation"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:asphyxia_neonatorum rdfs:subClassOf :respiratory_system_disease ;
    :has_definition "A respiratory system disease that is characterized by deprivation of oxygen to a newborn infant that lasts long enough during the birth process to cause physical harm, usually to the brain." ;
    :has_exact_match "MESH:D001238" ;
    :has_exact_synonym "Asphyxia - birth"@en,
        "Asphyxia, in liveborn infant"@en,
        "Birth asphyxia"@en,
        "postnatal asphyxia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:q_fever rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pleuritic_chest_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :joint_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :contact_transmission ;
                            rdf:rest [ rdf:first :airborne_transmission ;
                                    rdf:rest [ rdf:first :vehicle_borne_ingestion_transmission ;
                                            rdf:rest [ rdf:first :tick_borne_transmission ;
                                                    rdf:rest :nil ] ] ] ] ] ],
        :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that is a zoonotic infectious disease affecting multiple organs, has_material_basis_in Coxiella burnetii, which is transmitted_by inhalation of air contaminated by barnyard dust containing dried placental material, birth fluids, or excreta of infected herd animals, transmitted_by ingestion of contaminated milk, transmitted_by tick bites and transmitted_by contact with infected person. The infection has_symptom fever, has_symptom headache, has_symptom cough, has_symptom pleuritic chest pain, has_symptom myalgia and has_symptom arthralgia." ;
    :has_exact_synonym "Infection due to Coxiella burnetii"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:trench_fever rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :bartonella_quintana ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :pediculus_humanus_corporis ],
        :bartonellosis ;
    :has_definition "A primary bacterial infectious disease that results in systemic infection, has_material_basis_in Bartonella quintana, which is transmitted by body lice (Pediculus humanus corporis). The infection has symptom relapsing fever, has symptom headache, has symptom shin pain, and has symptom soreness of the muscles of the legs and back." ;
    :has_exact_match "MESH:D014205" ;
    :has_exact_synonym "His-Werner disease"@en,
        "Quintan fever"@en,
        "Wolhynian fever"@en,
        "shin bone fever"@en,
        "tibialgic fever"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bartonellosis rdfs:subClassOf :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that is caused by the bacteria of the genus Bartonella." ;
    :has_exact_synonym "Bartonella infectious disease"@en,
        "Rochalimaea infection"@en,
        "bartonelliasis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rickettsialpox rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :rickettsia_akari ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :insect_borne_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chills ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        :spotted_fever ;
    :has_definition "A spotted fever that has_material_basis_in Rickettsia akari, which is transmitted_by house mouse mite (Liponyssoides sanguineus) found on mice and other rodents. The infection has_symptom fever, has_symptom chills, has_symptom headache, has_symptom myalgia, and has_symptom papulovesicular rash." ;
    :has_exact_synonym "Rickettsia akari spotted fever"@en,
        "Vesicular rickettsiosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spotted_fever rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :insect_borne_transmission ;
                            rdf:rest [ rdf:first :tick_borne_transmission ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :rickettsia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fatigue ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :maculopapular_rash ],
        :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that results in infection, located in endothelial cell of artery or located in endothelial cell of vein, has_material_basis_in Rickettsia, which is transmitted by ticks and mites. The infection has symptom fever, has symptom headache, has symptom fatigue, has symptom muscle aches, and has symptom maculopapular or petechial rash. A distinctive eschar (blackened or crusted skin) may develop at the site of a tick bite." ;
    :has_exact_synonym "Spotted fever group rickettsial disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fundus_albipunctatus rdfs:subClassOf :fundus_dystrophy ;
    :has_definition "A fundus dystrophy that is characterized by discrete uniform white dots over the entire fundus with greatest density in the midperiphery and no macular involvement." ;
    :has_exact_synonym "Pigmentary retinal dystrophy"@en,
        "retinitis punctata albescens"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gilles_de_la_tourette_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :motor_tics ],
        :tic_disorder ;
    :has_definition "A tic disorder that is characterized by multiple physical (motor) tics and at least one vocal (phonic) tic present for more than a year." ;
    :has_exact_synonym "Guinon's disease"@en,
        "Psychogenic tics"@en,
        "Tourette syndrome"@en,
        "motor-verbal tic disorder"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:psychologic_dyspareunia rdfs:subClassOf :psychosexual_disorder ;
    :has_exact_synonym "Dyspareunia, psychogenic"@en,
        "Non-organic dyspareunia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pulpitis rdfs:subClassOf :dental_pulp_disease ;
    :has_definition "A dental pulp disease characterized by inflammation." ;
    :has_exact_synonym "pulp stones" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:henoch_schoenlein_purpura rdfs:subClassOf :hypersensitivity_vasculitis ;
    :has_definition "A hypersensitivity vasculitis that is characterized by purpura (purplish plaques), arthralgia, gastrointestinal upset, and/or glomerulonephritis, and may be related to increased immune response following an infection." ;
    :has_exact_synonym "Allergic purpura"@en,
        "Autoimmune purpura"@en,
        "Henoch-Sch?nlein purpura"@en,
        "Henoch-Sch@nlein purpura"@en,
        "Henoch-Scholein purpura"@en,
        "Henoch-Schonlein Purpura"@en,
        "Purpura, autoimmune"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:qualitative_platelet_defect rdfs:subClassOf :blood_platelet_disease ;
    :has_exact_synonym "Qualitative platelet deficiency"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acquired_thrombocytopenia rdfs:subClassOf :thrombocytopenia ;
    :has_exact_synonym "secondary thrombocytopenia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:prostatic_cyst rdfs:subClassOf :prostatic_hypertrophy ;
    :has_exact_synonym "Cyst of prostate"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:prolapse_of_lacrimal_gland rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :lacrimal_gland ],
        :lacrimal_apparatus_disease ;
    :has_exact_synonym "Dislocation of lacrimal gland"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:esophagus_sarcoma rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :derives_from ;
                            owl:someValuesFrom :embryonic_cell_metazoa_ ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :esophagus ] ;
                            rdf:rest :nil ] ] ],
        :esophageal_cancer,
        :sarcoma ;
    :has_definition "An esophageal cancer that arises from transformed cells of mesenchymal origin sarcoma and located_in the esophagus." ;
    :has_related_synonym "esophageal sarcoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypersecretion_glaucoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pain ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :ocular_hypertension ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :loss_of_vision ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bloodshot_eye ],
        :glaucoma ;
    :has_definition "A glaucoma characterized by high aqueous fluid production and inflow relative to aqueous fluid outflow leading to inappropriately elevated intraocular pressure, which may lead to optic nerve damage and visual field loss. Hypersecretion glaucoma has_symptom progressive peripheral vision loss, decreased vision, and pain, redness, and headache in acute cases. Hypersecretion glaucoma is caused by high aqueous fluid inflow relative to outflow." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aqueous_misdirection rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :ocular_hypertension ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bloodshot_eye ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :loss_of_vision ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        :glaucoma ;
    :has_definition "A glaucoma characterized by shallowing of the central and peripheral anterior chamber from posterior pressure such that the intraocular pressure becomes inappropriately elevated leading to optic nerve damage and visual field loss. Aqueous misdirection has_symptom progressive peripheral vision loss, decreased vision, and pain, redness, and headache in acute cases. Aqueous misdirection is caused by an abnormal relationsihp between the ciliary body, lens, and anterior vitreous such that aqueous flow is diverted into the posterior segment, leading to increased posterior pressure, which further closes the angle. Aqueous misdirection may occur in association with glaucoma surgery, trauma, endophthalmitis, and retinopathy of prematurity." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sarcoma rdfs:subClassOf :cell_type_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :derives_from ;
                                    owl:someValuesFrom :embryonic_cell_metazoa_ ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A cell type cancer that has_material_basis_in abnormally proliferating cells derives from embryonic mesoderm." ;
    :has_exact_synonym "connective and soft tissue neoplasm"@en,
        "tumor of soft tissue and skeleton"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:miliaria_rubra rdfs:subClassOf :miliaria ;
    :has_definition "A miliaria that is characterized by erythematous papules resulting in leakage of sweat into the deeper, subcorneal layers of the epidermis provoking a local inflammatory reaction." ;
    :has_exact_synonym "prickly heat"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypohidrosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hyperthermia ],
        :sweat_gland_disease ;
    :has_definition "A sweat gland disease that is characterized by reduced ability to sweat, has_symptom hyperthermia and dry skin of affected areas, and has_material_basis_in trauma to the sweat glands." ;
    :has_exact_match "MESH:D007007" ;
    :has_exact_synonym "Oligohidrosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anhidrosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hyperthermia ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :anhidrosis ],
        :hypohidrosis ;
    :has_definition "A hypohidrosis that is characterized by the inability to sweat and has_symptom hyperthermia and dry skin." ;
    :has_exact_synonym "Adiaphoresis"@en,
        "absence of sweating"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pertussis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :bordetella_parapertussis ;
                            rdf:rest [ rdf:first :bordetella_pertussis ;
                                    rdf:rest :nil ] ] ] ],
        :commensal_bacterial_infectious_disease ;
    :has_definition "A commensal bacterial infectious disease that results_in inflammation located_in respiratory tract, has_material_basis_in Bordetella pertussis, or has_material_basis_in Bordetella parapertussis, which produce toxins that paralyze the cilia of the respiratory epithelial cells. The infection is characterized by a prolonged, high-pitched, deeply indrawn breath (whoop)." ;
    :has_exact_synonym "WC - Whooping cough"@en,
        "bordetella infection"@en,
        "whooping cough"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neonatal_respiratory_failure rdfs:subClassOf :respiratory_failure ;
    :has_definition "A respiratory failure that is characterized by inadequate gas exchange by the respiratory system in neonates." ;
    :has_exact_synonym "respiratory failure of newborn"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:respiratory_failure rdfs:subClassOf :lung_disease ;
    :has_definition "A lung disease characterized by inadequate gas exchange by the respiratory system." ;
    :has_exact_synonym "acute and chronic respiratory failure"@en,
        "acute respiratory Failure"@en,
        "acute-on-chronic respiratory failure"@en,
        "chronic respiratory failure"@en,
        "respiratory insufficiency/failure"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:band_keratopathy rdfs:subClassOf :corneal_degeneration ;
    :has_exact_synonym "Band-shaped keratopathy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:common_wart rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :human_papillomavirus_types ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that results_in infection located_in skin, has_material_basis_in human papillomavirus (types 2 and 4). This infection is characterized by a raised wart with roughened surface, most common on hands, but can grow anywhere on the body." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:human_papillomavirus_infectious_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :contact_transmission ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that has_material_basis_in human papillomaviruses, which establish productive infections only in the stratified epithelium of the skin or mucous membranes. These viruses cause warts and sometimes tumors. They are transmitted_by sexual contact." ;
    :has_exact_synonym "HPV" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anogenital_venereal_wart rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :contact_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :alphapapillomavirus_10 ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :anogenital_venereal_wart ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :uterine_cervix ;
                            rdf:rest [ rdf:first :oral_cavity ;
                                    rdf:rest [ rdf:first :throat ;
                                            rdf:rest [ rdf:first :penis ;
                                                    rdf:rest [ rdf:first :uterus ;
                                                            rdf:rest [ rdf:first :vagina ;
                                                                    rdf:rest [ rdf:first :anus ;
                                                                            rdf:rest [ rdf:first :scrotum ;
                                                                                    rdf:rest :nil ] ] ] ] ] ] ] ] ] ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that results_in infection located_in skin of vagina, cervix, uterus, anus, penis, scrotum, mouth, or throat, has_material_basis_in human papillomaviruses (types 6 and 11), which are transmitted_by direct contact with the skin during oral, genital, or anal sex with an infected partner. The infection has_symptom anogenital warts." ;
    :has_exact_synonym "Anogenital Human papilloma Virus Infectious Disease"@en,
        "Anogenital warts"@en,
        "Genital warts"@en,
        "genital wart virus infectious disease"@en,
        "venereal wart"@en ;
    :has_related_synonym "Condyloma acuminatum"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

