    :has_definition "A otitis media which involves transudation of fluid in the middle ear without pus formation." ;
    :has_exact_synonym "Nonsuppurative otitis media"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:serous_glue_ear rdfs:subClassOf :non_suppurative_otitis_media ;
    :has_definition "A non-suppurative otitis media that is characterized by effusion with very thick and glue-like middle ear fluid which may cause conductive hearing impairment." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:allescheriosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :scedosporium_boydii ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abscess ],
        :primary_systemic_mycosis ;
    :has_definition "A primary systemic mycosis that results_in systemic fungal infection, has_material_basis_in Pseudallescheria boydii, which results_in_formation_of abscesses." ;
    :has_exact_synonym "Petriellidosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pseudomembranous_conjunctivitis rdfs:subClassOf :acute_conjunctivitis ;
    :has_definition "A acute conjunctivitis which involves a fibrin-rich exudate formation on the surface of the conjunctiva. Infectious causes of pseudomembranes include Corynebacterium diphtheriae, streptococci, pneumococci, herpes simplex virus, adenovirus, Chlamydia and gonococci. Other causes include chemical (alkali) irritants, erythema multiforme, and ocular pemphigoid." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:syndactyly rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormal_digit_morphology ],
        :synostosis ;
    :has_definition "A synostosis that results_in the fusion of two or more digits." ;
    :has_exact_match "MESH:D013576" ;
    :has_exact_synonym "chromosome 2q35 duplication syndrome"@en,
        "symphalangism"@en,
        "symphalangy"@en,
        "webbing of digits"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_laryngopharyngitis rdfs:subClassOf :upper_respiratory_tract_disease ;
    :has_definition "An upper respiratory tract disease which involves inflammation of both larynx and pharynx." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:serous_conjunctivitis_except_viral rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :acute_conjunctivitis ;
    :has_definition "A viral acute conjunctivitis that is characterized by conjunctival inflammation and serous discharge." ;
    :has_exact_synonym "serous conjunctivitis, except viral"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:di_george_syndrome rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :has_material_basis_in ;
                            owl:someValuesFrom :deletion ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_material_basis_in ;
                                    owl:someValuesFrom :chromosome ] ;
                            rdf:rest :nil ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :gene ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :chromosomal_deletion_syndrome,
        :syndrome ;
    :has_definition "A syndrome that has_material_basis_in a large deletion of the chromosome 22q11.2 region which includes the DGS gene needed for development of the thymus and related glands with subsequent lack of T-cell production." ;
    :has_exact_synonym "22q11.2 deletion syndrome"@en,
        "DiGeorge sequence"@en,
        "DiGeorge's syndrome"@en,
        "Pharyngeal pouch syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypoparathyroidism rdfs:subClassOf :parathyroid_gland_disease ;
    :has_definition "A parathyroid gland disease characterized by decreased function of parathyroid glands with underproduction of parathyroid hormone (PTH), leading to abnormally low ionized calcium levels in the blood." ;
    :has_exact_match "MESH:D007011" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:esophageal_varix rdfs:subClassOf :esophageal_disease,
        :vein_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :vein_disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :esophagus ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Bleeding esophageal varices"@en,
        "Bleeding oesophageal varices"@en,
        "esophageal varices"@en,
        "esophageal varices in disease classified elsewhere, with bleeding"@en,
        "esophageal varices with bleeding"@en,
        "esophageal varices with bleeding in disease EC"@en,
        "esophageal varices without bleeding"@en,
        "esophageal varices without mention of bleeding"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:t_cell_deficiency rdfs:subClassOf :primary_immunodeficiency_disease ;
    :has_definition "A primary immunodeficiency disease that is characterized by decreased numbers of circulating or functioning T cells." ;
    :has_exact_synonym "T cell immunodeficiency"@en,
        "T lymphocyte deficiency"@en,
        "T lymphocyte immunodeficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:parathyroid_gland_disease rdfs:subClassOf :endocrine_system_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :parathyroid_gland ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An endocrine system disease that is located_in the parathyroid gland." ;
    :has_exact_synonym "disease of parathyroid glands"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_hyperparathyroidism rdfs:subClassOf :hyperparathyroidism ;
    :has_definition "A hyperparathyroidism that is characterized by overproduction of parathyroid hormone and elevated levels of calcium in the blood." ;
    :has_exact_synonym "familial primary hyperparathyroidism"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

