    :has_exact_synonym "Angelucci syndrome"@en,
        "acute atopic conjunctivitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:allergic_conjunctivitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :allergic_reaction ],
        :allergic_disease,
        :chronic_conjunctivitis ;
    :has_definition "A chronic conjunctivitis that is an inflammation of the conjunctiva involing red, itchy, and watery eyes a resulting from an exposure to an allergen or an irritant." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:opioid_abuse rdfs:subClassOf :substance_abuse ;
    :has_definition "A substance abuse that involves the recurring use of opioid drugs despite negative consequences." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:buphthalmos rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :ocular_hypertension ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :photophobia ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :blepharospasm ],
        :hydrophthalmos ;
    :has_definition "A hydrophthalmos characterized by early onset glaucoma in one or both eyes with elevated intraocular pressure, increased corneal diameter, and swelling of the globe and has_symptom early vision loss, photophobia, blepharospasm, tearing, increased corneal diameter, increased corneal thickness, and enlarged globe. Buphthalmos is caused by severe congenital defects of the trabecular meshwork and anterior chamber angle that block aqueous outflow and raises intraocular pressure, leading to optic nerve atrophy and early vision loss." ;
    :has_exact_synonym "primary congenital glaucoma 3A",
        "simple buphthalmos"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hydrophthalmos rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :ocular_hypertension ],
        :primary_congenital_glaucoma ;
    :has_definition "A primary congenital glaucoma characterized by early onset glaucoma in one or both eyes with elevated intraocular pressure and increased corneal diameter and has_symptom early vision loss, increased corneal diameter, and increased corneal thickness. Hydrophthalmus is caused by congenital defects of the trabecular meshwork and anterior chamber angle that block aqueous outflow and raises intraocular pressure, leading to optic nerve atrophy and early vision loss." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_contagious_conjunctivitis rdfs:subClassOf :acute_conjunctivitis ;
    :has_definition "A bacterial acute conjunctivitis that is characterized by highly contagious conjunctival hypermia and mucopurulent discharge and has_material_basis_in Hemophilius Aegypticus." ;
    :has_exact_synonym "Contagious opthalmia"@en,
        "Pink eye"@en,
        "Pinkeye"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

