    :has_definition "An acute conjunctivitis characterized by conjunctival folliculosis and follicular hypertrophy of the palpebral conjunctivae." ;
    :has_exact_synonym "acute follicular conjunctivitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
