:orbital_osteomyelitis rdfs:subClassOf :acute_orbital_inflammation ;
    :has_definition "An acute orbital inflammation that is characterized by inflammation of the medullary cavity of orbital bone that eventually spreads to the periosteum." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

