        :acute_orbital_inflammation ;
    :has_definition "An acute orbital inflammation that is characterized by painful orbital mass and has_symptom eyelid edema, has_symptom erythema, has_symptom chemiosis, has_symptom proptosis, has_symptom blurred vision, has_symptom headache, has_symptom fever and has_symptom double vision." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

