@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vitamin_k_deficiency_bleeding rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bleeding ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        :nutritional_deficiency_disease ;
    :has_definition "A nutritional deficiency disease that is characterized by easy bleeding due to an inability to form blood clots caused by vitamin K deficiency, occurs most commonly in newborns, and has_material_basis_in deficiency of vitamin K secondary to liver prematurity, lack of vitamin K in a breastmilk diet, largely sterile gut, malabsorption, diarrhea, chronic illness, menorrhagia, chronic kidney disease, and some medications." ;
    :has_exact_synonym "deficiency of vitamin K"@en,
        "vitamin K deficiency"@en,
        "vitamin K deficiency hemorrhagic disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

