    :has_definition "An epidemic typhus that is a mild form of the disease, which recurs in someone after a long period of latency due to immunosuppression, malnutrition or other illnesses." ;
    :has_exact_synonym "Brill Zinsser disease"@en,
        "Brill's disease"@en,
        "Recrudescent typhus"@en ;
    :has_related_synonym "Latent typhus"@en,
        "Sporadic typhus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

