        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chills ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :rash ],
        :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that results_in systemic infection, has_material_basis_in Chlamydia psittaci, which is transmitted_by inhaling aerosolized dried droppings or transmitted_by contact with infected birds. The infection has_symptom fever, has_symptom headache, has_symptom rash, has_symptom chills, and has_symptom pneumonia." ;
    :has_exact_synonym "psittacosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chlamydia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :contact_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :chlamydia_trachomatis ],
        :commensal_bacterial_infectious_disease ;
    :has_definition "A commensal bacterial infectious disease that is caused by Chlamydia trachomatis." ;
    :has_exact_synonym "Chlamydia trachomatis infectious disease"@en,
        "Chlamydial Infection"@en,
        "chlamydial disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:trachoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :congenital_transmission ;
                            rdf:rest [ rdf:first :contact_transmission ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :eye ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :chlamydia_trachomatis ],
        :commensal_bacterial_infectious_disease,
        :eye_disease ;
    :has_definition "A commensal bacterial infectious disease that results_in infection located_in eye, has_material_basis_in Chlamydia trachomatis (A, B, Ba and C serovars), which is transmitted_by contact with eye discharge from the infected person and transmitted_by congenital method. The infection causes eyelid to turn inward which makes eyelashes to scratch the cornea." ;
    :has_exact_synonym "active stage trachoma"@en,
        "trachoma dubium"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

