            owl:onProperty :has_symptom ;
            owl:someValuesFrom :renal_failure ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :orthohantavirus_dobravaense ;
                            rdf:rest [ rdf:first :orthohantavirus_hantanense ;
                                    rdf:rest [ rdf:first :orthohantavirus_puumalaense ;
                                            rdf:rest [ rdf:first :orthohantavirus_seoulense ;
                                                    rdf:rest :nil ] ] ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :petechiae ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :renal_insufficiency ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :proteinuria ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        :kidney_disease,
        :viral_infectious_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :viral_infectious_disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :kidney ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A viral infectious disease that is a hemorrhagic fever, located in kidney, has_material_basis_in Orthohantavirus dobravaense, has_material_basis_in Orthohantavirus hantanense, has_material_basis_in Orthohantavirus puumalaense, has_material_basis_in Orthohantavirus seoulense, which are carried and transmitted by rodents. The infection has symptom headache, has symptom fever, has symptom muscle pains, has symptom facial flush, has symptom petechiae, has symptom proteinuria, and has symptom renal failure." ;
    :has_exact_synonym "HFRS"@en,
        "Hemorrhagic fever, Russian"@en,
        "Hemorrhagic nephrosonephritis"@en,
        "Puumala virus nephropathy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

