    :has_exact_synonym "Air-conditioner and humidifier lung"@en,
        "Humidifier lung"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:arteriovenous_malformation rdfs:subClassOf :hemangioma ;
    :has_definition "A hemangioma that is characterized by a configuration of blood vessels that shunts arterial blood directly into veins by bypassing the capillary system." ;
    :has_exact_synonym "Arteriovenous hemangioma"@en,
        "Cirsoid aneurysm"@en,
        "Racemose Angioma"@en,
        "Racemose aneurysm"@en,
        "Racemose hemangioma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vertebral_artery_occlusion rdfs:subClassOf :artery_disease,
        :occlusion_precerebral_artery ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :occlusion_precerebral_artery ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :vertebral_artery ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Occlusion and stenosis of vertebral artery"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pituitary_infarct rdfs:subClassOf :necrosis_of_pituitary ;
    :has_exact_synonym "Pituitary infarction"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cercarial_dermatitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :zone_of_skin ],
        :schistosomiasis,
        :skin_disease ;
    :has_definition "A schistosomiasis that is a short-term, cutaneous inflammatory response associated with penetration of the skin by cercariae of bird schistosome, Austrobilharzia variglandis. The disease has symptom skin reddening, has symptom skin itching, in the water or immediately after emerging and has symptom itchy, raised papules, occur within hours of infection." ;
    :has_exact_synonym "Cutaneous schistosomiasis"@en,
        "Sea bather's eruption"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mobitz_type_ii_atrioventricular_block rdfs:subClassOf :second_degree_atrioventricular_block ;
    :has_exact_synonym "Mobitz (type) II atrioventricular block"@en,
        "Mobitz II atrioventricular block"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:african_histoplasmosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :airborne_transmission ],
        :histoplasmosis ;
    :has_definition "A histoplasmosis that results in systemic fungal infection, has_material_basis_in Histoplasma capsulatum var duboisii, transmitted by airborne spores and results in formation of nodules, results in formation of ulcers and results in formation of osteolytic bone lesions." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:histoplasmosis_retinitis rdfs:subClassOf :retinitis ;
    :has_exact_synonym "Histoplasmosis with retinitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:kyasanur_forest_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dehydration ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :kyasanur_forest_disease_virus ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bleeding ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :stiff_neck ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that is a hemorrhagic fever, has_material_basis_in Kyasanur forest disease virus, which is transmitted by Haemaphysalis spinigera tick bite. The infection has symptom fever, has symptom headache, has symptom stiffness of the neck, has symptom severe muscle pain, has symptom cough, has symptom dehydration, and has symptom bleeding problems." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:schizophreniform_disorder rdfs:subClassOf :psychotic_disorder ;
    :has_definition "A psychotic disorder that involves schizophrenia symptoms over time period of one month." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ainhum rdfs:subClassOf :connective_tissue_disease ;
    :has_definition "A connective tissue disease that results in increasing fibrous constriction and ultimately in spontaneous amputation of the toes and especially the little toes. A painful constriction of the base of the fifth toe frequently followed by bilateral spontaneous amputation (autoamputation) a few years later." ;
    :has_exact_match "MESH:D000387" ;
    :has_exact_synonym "Dactylolysis spontanea"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sarcoidosis rdfs:subClassOf :hypersensitivity_reaction_type_iv_disease ;
    :has_definition "A hypersensitivity reaction type IV disease characterized by the growth of collections of inflammatory cells (granulomas) in multiple organs." ;
    :has_exact_match "MESH:D012507" ;
    :has_exact_synonym "Boeck sarcoid"@en,
        "lymphogranulomatosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rhinoscleroma rdfs:subClassOf :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that involves the inflammation of mucosa lining the nasal cavity, pharynx, larynx, trachea and bronchi that is characterized by the formation of granulomas, dense induration of the tissues and nodular deformity caused by Klebsiella rhinoscleromatis." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lemierre_s_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abscess ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chills ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :leukocytosis ],
        :commensal_bacterial_infectious_disease ;
    :has_definition "A commensal bacterial infectious disease that is characterized by systemic sepsis, ulcerative or necrotic lesions and multisystem abscesses caused by Fusobacterium necrophorum. The disease often first presents as a severe tonsillitis or pharyngitis with high-grade fever and chills together with leukocytosis, cervical pain and neck swelling." ;
    :has_exact_synonym "Lemierre syndrome"@en,
        "human necrobacillosis"@en,
        "postanginal sepsis"@en ;
    :has_related_synonym "acute sore throat"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tetanus rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :clostridium_tetani ],
        :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that results in prolonged contraction of skeletal muscle fibers, has_material_basis_in Clostridium tetani, which produces tetanospasmin, a neurotoxin, which is carried to the brain and spinal cord, where it binds irreversibly to receptors inhibiting neurotransmission. Damaged upper motor neurons cannot control reflex responses to afferent sensory stimuli." ;
    :has_exact_synonym "Infection due to Clostridium tetani"@en,
        "clostridial tetanus"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pneumocystosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :pneumocystis_jirovecii ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :lung ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dyspnea ],
        :lung_disease,
        :opportunistic_mycosis ;
    :has_definition "An opportunistic mycosis that is located in lungs, but can also occur in eyes, ears, skin, thyroid, pituitary, palate, parathyroid, esophagus, pleura, heart, liver, spleen, small intestine, adrenals, kidneys, bone marrow, and lymph nodes, has_material_basis_in Pneumocystis jirovecii that effects interstitial and alveolar tissues and has symptom nonproductive cough, has symptom shortness of breath, and has symptom fever." ;
    :has_exact_synonym "Pneumocystis carinii pneumonia"@en,
        "Pneumocystis jirovecii pneumonia"@en,
        "Pneumocystis pneumonia"@en,
        "Pneumocystosis pneumonia"@en,
        "pulmonary pneumocystosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:arcus_senilis rdfs:subClassOf :corneal_degeneration ;
    :has_exact_synonym "Arcus of cornea"@en,
        "corneal arcus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:scleral_disease rdfs:subClassOf :eye_disease ;
    :has_definition "An eye disease that affects the sclera, which is the white fibrous outer layer of the eyeball." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bladder_diverticulum rdfs:subClassOf :bladder_disease ;
    :has_exact_synonym "Diverticulum - bladder"@en,
        "Diverticulum of bladder"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:stone_in_bladder_diverticulum rdfs:subClassOf :bladder_diverticulum ;
    :has_exact_synonym "calculus in diverticulum of bladder"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

