            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :urinary_bladder ],
        :bladder_disease,
        :lower_urinary_tract_calculus .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:phlebotomus_fever rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :joint_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :tachycardia ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :phlebotomus_papatasi ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :flushing ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :sandfly_fever_naples_virus ;
                            rdf:rest [ rdf:first :sandfly_fever_sicilian_virus ;
                                    rdf:rest :nil ] ] ] ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that results in infection, has_material_basis_in Sandfly fever Naples virus, or has_material_basis_in Sandfly fever sicilian virus, which are transmitted by Phlebotomus papatasi sandfly. The infection has symptom fever, has symptom severe frontal headaches, has symptom muscle ache, has symptom joint aches, has symptom flushing of the face, and has symptom tachycardia." ;
    :has_exact_synonym "Sandfly fever"@en,
        "Sandfly-borne arboviral fever"@en,
        "Sandfly-borne bunyavirus fever"@en,
        "Sandfly-borne phleboviral disease"@en,
        "pappataci fever"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lens_subluxation rdfs:subClassOf :lens_disease ;
    :has_exact_match "MESH:D007906" ;
    :has_exact_synonym "Subluxation of lens"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_aphakia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :lens_disease,
        :physical_disorder ;
    :has_exact_synonym "APHAKIA, CONGENITAL PRIMARY"@en,
        "Congenital absence of lens"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:functional_diarrhea rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        :colonic_disease ;
    :has_exact_synonym "functional diarrhoea"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:megacolon rdfs:subClassOf :colonic_disease ;
    :has_definition "A colonic disease that is characterized by an abnormal dilation of the colon." ;
    :has_exact_synonym "Dilatation of colon"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gnathomiasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :gnathostoma ],
        :parasitic_helminthiasis_infectious_disease ;
    :has_definition "A parasitic helminthiasis infectious disease that involves parasitic infection due to migrating immature worms of Gnathostoma spinigerum or Gnathostoma hispidum, which occurs by eating undercooked fish or poultry containing third-stage larvae, or by drinking water containing infective second-stage larvae in Cyclops. Migration in the subcutaneous tissues causes intermittent, migratory, painful, pruritic swellings (cutaneous larva migrans). Migration to other tissues (visceral larva migrans), result in cough, hematuria, and ocular involvement, with the most serious manifestations eosinophilic meningitis with myeloencephalitis." ;
    :has_exact_synonym "Gnathostomiasis"@en,
        "Infectious Disease by Gnathostoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spinal_meningioma rdfs:subClassOf :meningioma,
        :spinal_canal_and_spinal_cord_meningioma ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :meningioma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :spinal_cord ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Spinal Cord meningioma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cryptorchidism rdfs:subClassOf :disorder_of_sexual_development ;
    :has_exact_synonym "Cryptorchism"@en,
        "Undescended testicle"@en,
        "Undescended testis"@en,
        "undescended testicles"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:expressive_language_disorder rdfs:subClassOf :language_disorder ;
    :has_definition "A language disorder that involves difficulties with verbal and written expression characterized by an ability to use expressive spoken language that is markedly below the appropriate level for the mental age, but with a language comprehension that is within normal limits." ;
    :has_exact_synonym "Developmental expressive language disorder"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:epidural_abscess rdfs:subClassOf :central_nervous_system_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :epidural_space ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A central nervous system disease that is characterized by a collection of pus (infected material) between the outer covering of the brain and spinal cord and the bones of the skull or spine and is caused by infection in the area between the bones of the skull or spine, and the membranes covering the brain and spinal cord (meninges)." ;
    :has_exact_synonym "abscess epidural"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:subdural_empyema rdfs:subClassOf :central_nervous_system_disease ;
    :has_definition "A central nervous system disease that is characterized by the collection or gathering of pus within the subdural space." ;
    :has_exact_synonym "Subdural abscess"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cerebral_arteritis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :cerebrum ],
        :cerebrovascular_disease .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adult_respiratory_distress_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :shock ],
        [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :adult_onset ],
        :respiratory_failure ;
    :has_definition "A respiratory failure that results from diffuse injury to the endothelium of the lung (as in sepsis, chest trauma, massive blood transfusion, aspiration of the gastric contents, or pneumonia) and is characterized by pulmonary edema with an abnormally high amount of protein in the edematous fluid and by difficult rapid breathing and hypoxemia." ;
    :has_exact_synonym "acute respiratory distress syndrome",
        "ARDS"@en,
        "Non-cardiogenic pulmonary edema"@en,
        "Shock lung"@en,
        "adult RDS"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pulmonary_edema rdfs:subClassOf :respiratory_failure ;
    :has_definition "A respiratory failure that is characterized by the accumulation of fluid in the lung tissues causing disturbance of the gas exchange that may lead to respiratory failure." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:heart_disease rdfs:subClassOf :cardiovascular_system_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :heart ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A cardiovascular system disease that involves the heart." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diphtheria rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :contact_transmission ;
                            rdf:rest [ rdf:first :droplet_spread_transmission ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :corynebacterium_diphtheriae ],
        :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that is characterized by sore throat, low fever, and an adherent membrane (a pseudomembrane) on the tonsils, pharynx, and/or nasal cavity. A milder form of diphtheria can be restricted to the skin. It is caused by Corynebacterium diphtheriae, an aerobic Gram-positive bacterium. Diphtheria toxin spreads through the bloodstream and can lead to potentially life-threatening complications that affect other organs of the body, such as the heart and kidneys." ;
    :has_exact_synonym "corynebacterium infection"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fallopian_tube_endometriosis rdfs:subClassOf :endometriosis,
        :fallopian_tube_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :endometriosis ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :fallopian_tube ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A female reproductive system disease characterized by the growth of endometrial tissue that is located_in the fallopian tube." ;
    :has_exact_synonym "Endometriosis of fallopian tube"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:endosalpingiosis rdfs:subClassOf :endometriosis ;
    :has_definition "A female reproductive system disease characterized by the growth of fallopian tube-like epithelium outside the fallopian tube." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:endometriosis_of_intestine rdfs:subClassOf :endometriosis,
        :intestinal_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :endometriosis ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :intestine ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A female reproductive system disease characterized by the growth of endometrial tissue that is located_in the intestine." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:endometriosis_of_pelvic_peritoneum rdfs:subClassOf :endometriosis ;
    :has_definition "A female reproductive system disease characterized by the growth of endometrial tissue that is located_in the pelvic peritoneum." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:exotropia rdfs:subClassOf :strabismus ;
    :has_exact_synonym "Divergent Strabismus"@en,
        "Divergent concomitant strabismus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:endometriosis_in_scar_of_skin rdfs:subClassOf :endometriosis ;
    :has_definition "A female reproductive system disease characterized by the growth of endometrial tissue that is located_in the scar of the skin." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:endometriosis_of_rectovaginal_septum_and_vagina rdfs:subClassOf :endometriosis ;
    :has_definition "A female reproductive system disease characterized by the growth of endometrial tissue that is located_in the rectovaginal septum and vagina." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:endometriosis_of_ovary rdfs:subClassOf :endometriosis,
        :ovarian_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :endometriosis ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :ovary ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A female reproductive system disease characterized by the growth of endometrial tissue that is located_in the ovary." ;
    :has_exact_synonym "ovarian endometriosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:allergic_cutaneous_vasculitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :allergic_reaction ],
        :allergic_disease,
        :hypersensitivity_vasculitis ;
    :has_definition "A hypersensitivity vasculitis that results_in inflammation of small blood vessels, characterized clinically by palpable purpura, which is a slightly elevated purpuric rash over one or more areas of the skin." ;
    :has_exact_synonym "Allergic Cutaneous Angiitis"@en,
        "Autoimmune Hypersensitivity angiitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brain_compression rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abscess ],
        :brain_disease ;
    :has_definition "A brain disease that is characterized by pressure on the intracranial tissues by an effusion of blood or cerebrospinal fluid, an abscess, a neoplasm, a depressed fracture of the skull, or edema of the brain." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pseudotumor_cerebri rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :brain ],
        :intracranial_hypertension ;
    :has_exact_synonym "benign intracranial hypertension"@en,
        "idiopathic intracranial hypertension"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autonomic_nervous_system_disease rdfs:subClassOf :peripheral_nervous_system_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :autonomic_nervous_system ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A peripheral nervous system disease that is located_in the autonomic nervous system." ;
    :has_exact_synonym "autonomic nervous system disorder"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:subglottis_cancer rdfs:subClassOf :larynx_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :subglottis ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Ca larynx - subglottis"@en,
        "malignant Subglottic tumor"@en,
        "malignant tumor of subglottis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:osteoporosis rdfs:subClassOf :bone_resorption_disease ;
    :has_definition "A bone resorption disease characterized by decreased density of normally mineralized bone which results_in the thinning of bone tissue and decreased mechanical strength." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:polydactyly rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormal_digit_morphology ],
        :physical_disorder ;
    :has_definition "A physical disorder that is characterized by the presence of more than five fingers per hand or five toes per foot." ;
    :has_exact_synonym "postaxial polydactyly"@en ;
    :has_related_synonym "Supernumerary digit"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hemopericardium rdfs:subClassOf :pericardial_effusion ;
    :has_definition "A pericardial effusion that results from blood in the pericardial sac." ;
    :has_exact_synonym "Haemopericardium"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:horner_s_syndrome rdfs:subClassOf :autonomic_neuropathy ;
    :has_definition "An autonomic neuropathy that is characterized by the classic triad of unilateral ptosis, unilateral miosis with anisocoria, and ipsilateral facial anhidrosis, resulting from unilateral paralysis of the cervical sympathetics." ;
    :has_exact_synonym "Bernard Horner syndrome"@en,
        "Horner syndrome"@en,
        "cervical sympathetic paralysis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acquired_night_blindness rdfs:subClassOf :nutritional_deficiency_disease ;
    :has_definition "A nutritional deficiency disease that is characterized by vitamin A deficiency causing poor adaptation of the eyes to low levels of light, and has_material_basis_in lack of vitamin A such that rhodopsin, a light sensitive retinal pigment, cannot be regenerated." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cardiac_tamponade rdfs:subClassOf :pericardial_effusion ;
    :has_definition "A pericardial effusion in which fluid accumulates in the pericardium (the sac in which the heart is enclosed) and the pericardial spaces fills up faster than the pericardial sac can stretch." ;
    :has_exact_synonym "Rose's tamponade"@en,
        "pericardial tamponade"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:suppurative_otitis_media rdfs:subClassOf :otitis_media ;
    :has_definition "A otitis media which involves inflammation of the middle ear with infected effusion containing pus." ;
    :has_exact_synonym "Otitis media with effusion - purulent"@en,
        "Purulent otitis media"@en .
